INSERT INTO `config` (`id`, `tipo`, `higienizacao`, `cuidados`, `preparo`) VALUES
(1, 'aberto', 'A higiene pessoal de quem irá manipular a dieta é muito importante, por isso a pessoa deve manter os cabelos presos ou protegidos com touca, lenço ou rede; usar roupas limpas; manter unhas curtas e limpas; retirar anéis, pulseiras ou qualquer outro adorno; lavar bem as mãos com água e sabonete neutro; secar as mãos com toalha limpa ou com papel toalha; cobrir eventuais machucados na região das mãos, não fumar, tossir, espirrar ou conversar durante o preparo da dieta.\r\n\r\nO ambiente de preparo e manipulação da dieta, seja ele bancada, mesa ou outro, também merece atenção e deve ser lavado e desinfetado com álcool 70%. Lembre-se de sempre observar o frasco e equipo, descartar o produto que apresentar furos, rachaduras ou qualquer dano que impossibilite o uso.', 'Para o sucesso na administração e armazenamento da dieta fique atento a estas instruções:\r\n\r\n- Siga corretamente o volume e a infusão prescrita;\r\n\r\n- Entre 30 a 60 minutos antes do horário estipulado para a administração da dieta, retire os frascos já prontos da geladeira. A dieta deve ser dada ao paciente em temperatura ambiente;\r\n\r\n- Antes de administrar a dieta, verifique também se esta apresenta alguma alteração de cor, cheiro ou aspecto. Não ofertar caso encontre alguma diferença;\r\n\r\n- Antes de instalar a dieta enteral na sonda do paciente, observe se há danos na mesma como rachaduras, problemas na conexão ou vazamentos que impossibilitem a infusão;\r\n\r\n- Antes de conectar o equipo na sonda, é necessário realizar a higienização da conexão da ponta do equipo com álcool a 70% e gaze.\r\nPara a segurança do paciente, é importante que você siga todas as etapas, conforme as orientações:\r\n\r\n- Certifique-se que todas as etapas de higiene e preparo tenham sido feitas de forma adequada;\r\n\r\n- O posicionamento correto do paciente é imprescindível para minimizar o risco de broncoaspiração, ou seja, a entrada de alimentos, líquidos, saliva ou vômito para o pulmão;\r\n\r\n- Caso o paciente esteja acamado, a cabeceira deverá permanecer elevada de 30 a 45 graus durante a administração da dieta. Se o paciente não estiver acamado, ele pode também ficar sentado durante a infusão;\r\n\r\n- Conecte o frasco com a dieta no equipo e observe se está bem encaixado, para evitar vazamento;\r\n\r\n- Confira se o gotejamento da dieta está de acordo com a prescrição do nutricionista;\r\n\r\n- Monitore o gotejamento para que a dieta não seja infundida rapidamente;\r\n\r\n- O frasco deve estar a uma altura de, pelo menos, 60cm acima da cabeça do paciente;\r\n\r\n- O equipo pode ser utilizado por até 24h, desde que esteja sempre protegido quando não estiver sendo utilizado para infundir a dieta do paciente, evitando assim, contaminação;\r\n\r\n- Manter a cabeceira entre 30º e 45º ou o paciente sentado de 20 a 30 minutos após a infusão da dieta.', 'Para o preparo da dieta em pó, verifique a data de validade do produto;\n\nSepare os utensílios necessários, como funil, liquidificador, colher e copo graduado;\n\nHigienize todo o material com água e sabão, antes de utilizá-lo;\n\nPrepare apenas a quantidade de dieta prescrita pelo seu nutricionista e utilize água filtrada na quantidade recomendada e em temperatura ambiente;\n\nPara preparo da dieta pronta em sistema aberto, verifique sempre o prazo de validade da dieta;\n\nHigienize a caixa, tetra pack, e agite a embalagem, antes de abri-la, para que a dieta fique homogênea e, após a higienização dos materiais e utensílios, a dieta líquida deve ser depositada em frasco, conforme o volume prescrito para o paciente;\n\nRealize o fechamento da embalagem e mantenha o conteúdo sob refrigeração. Atente-se para as informações contidas no rótulo do produto, referentes à temperatura, armazenamento e o prazo de validade após aberto; e as dietas envasadas no frasco devem ficar em temperatura ambiente por um período máximo de 4 horas.\n\nJá as dietas prontas, em sistema fechado, são mais práticas e já vêm prontas para consumo.\n\nSiga corretamente as instruções do fabricante sobre a conexão da dieta ao equipo e sonda;\n\nObserve também a prescrição do nutricionista em relação ao volume e velocidade de infusão.\n\n\nPara acesso aos vídeos de orientação de alta, acesse o site: www.entric.com.br'),
(2, 'aberto_po', 'A higiene pessoal de quem irá manipular a dieta é muito importante, por isso a pessoa deve manter os cabelos presos ou protegidos com touca, lenço ou rede; usar roupas limpas; manter unhas curtas e limpas; retirar anéis, pulseiras ou qualquer outro adorno; lavar bem as mãos com água e sabonete neutro; secar as mãos com toalha limpa ou com papel toalha; cobrir eventuais machucados na região das mãos, não fumar, tossir, espirrar ou conversar durante o preparo da dieta.\r\n\r\nO ambiente de preparo e manipulação da dieta, seja ele bancada, mesa ou outro, também merece atenção e deve ser lavado e desinfetado com álcool 70%. Lembre-se de sempre observar o frasco e equipo, descartar o produto que apresentar furos, rachaduras ou qualquer dano que impossibilite o uso.', 'Para o sucesso na administração e armazenamento da dieta fique atento a estas instruções:\r\n\r\n- Siga corretamente o volume e a infusão prescrita;\r\n\r\n- Entre 30 a 60 minutos antes do horário estipulado para a administração da dieta, retire os frascos já prontos da geladeira. A dieta deve ser dada ao paciente em temperatura ambiente;\r\n\r\n- Antes de administrar a dieta, verifique também se esta apresenta alguma alteração de cor, cheiro ou aspecto. Não ofertar caso encontre alguma diferença;\r\n\r\n- Antes de instalar a dieta enteral na sonda do paciente, observe se há danos na mesma como rachaduras, problemas na conexão ou vazamentos que impossibilitem a infusão;\r\n\r\n- Antes de conectar o equipo na sonda, é necessário realizar a higienização da conexão da ponta do equipo com álcool a 70% e gaze.\r\nPara a segurança do paciente, é importante que você siga todas as etapas, conforme as orientações:\r\n\r\n- Certifique-se que todas as etapas de higiene e preparo tenham sido feitas de forma adequada;\r\n\r\n- O posicionamento correto do paciente é imprescindível para minimizar o risco de broncoaspiração, ou seja, a entrada de alimentos, líquidos, saliva ou vômito para o pulmão;\r\n\r\n- Caso o paciente esteja acamado, a cabeceira deverá permanecer elevada de 30 a 45 graus durante a administração da dieta. Se o paciente não estiver acamado, ele pode também ficar sentado durante a infusão;\r\n\r\n- Conecte o frasco com a dieta no equipo e observe se está bem encaixado, para evitar vazamento;\r\n\r\n- Confira se o gotejamento da dieta está de acordo com a prescrição do nutricionista;\r\n\r\n- Monitore o gotejamento para que a dieta não seja infundida rapidamente;\r\n\r\n- O frasco deve estar a uma altura de, pelo menos, 60cm acima da cabeça do paciente;\r\n\r\n- O equipo pode ser utilizado por até 24h, desde que esteja sempre protegido quando não estiver sendo utilizado para infundir a dieta do paciente, evitando assim, contaminação;\r\n\r\n- Manter a cabeceira entre 30º e 45º ou o paciente sentado de 20 a 30 minutos após a infusão da dieta.', 'Para o preparo da dieta em pó, verifique a data de validade do produto;\r\n\r\nSepare os utensílios necessários, como funil, liquidificador, colher e copo graduado;\r\n\r\nHigienize todo o material com água e sabão, antes de utilizá-lo;\r\n\r\nPrepare apenas a quantidade de dieta prescrita pelo seu nutricionista e utilize água filtrada na quantidade recomendada e em temperatura ambiente;\r\n\r\nPara preparo da dieta pronta em sistema aberto, verifique sempre o prazo de validade da dieta;\r\n\r\nHigienize a caixa, tetra pack, e agite a embalagem, antes de abri-la, para que a dieta fique homogênea e, após a higienização dos materiais e utensílios, a dieta líquida deve ser depositada em frasco, conforme o volume prescrito para o paciente;\r\n\r\nRealize o fechamento da embalagem e mantenha o conteúdo sob refrigeração. Atente-se para as informações contidas no rótulo do produto, referentes à temperatura, armazenamento e o prazo de validade após aberto; e as dietas envasadas no frasco devem ficar em temperatura ambiente por um período máximo de 4 horas.\r\n\r\nJá as dietas prontas, em sistema fechado, são mais práticas e já vêm prontas para consumo.\r\n\r\nSiga corretamente as instruções do fabricante sobre a conexão da dieta ao equipo e sonda;\r\n\r\nObserve também a prescrição do nutricionista em relação ao volume e velocidade de infusão.\r\n\r\n\r\nPara acesso aos vídeos de orientação de alta, acesse o site: www.entric.com.br'),
