(5, 1, 'Nutrison Protein Plus Multi Fiber', '/fotos_produtos/1644961553__nutrison-protein-plus-multi-fiber.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Pack \"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,25\"]', '[\"\"]', '[\"\"]', 'Danone', '125', '14', '6,3', '4,9', '1,5', 'Pacientes em risco nutricional ou desnutridos com necessidade calórico-proteico aumentada, associada à necessidade de regularização do trânsito intestinal.', 'Fórmula modificada para nutrição enteral, hiperproteica e hipercalórica. Especialmente formulada para auxiliar pacientes em risco nutricional ou desnutridos com necessidade calórico-proteica aumentada. Isenta de lactose, sacarose e glúten. Contém a mistura de quatro proteínas de alto valor biológico e mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA). Enriquecido com mix de carotenóides (alfa, beta e gama caroteno, licopeno, luteína e zeaxantina) e mix de fibras MF6. ', '', '', 1, '2021-11-07 09:03:18'),
(9, 1, 'Nutrison Advanced Cubison - Tetra Pack 1000ml', '/fotos_produtos/1656267652__cubison-tetrapack.jpg', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '100', '12', '5,5', '3,3', '1,5', 'Cicatrização de lesões por pressão e outras situações que requeiram cicatrização. \r\n', 'Fórmula modificada para nutrição enteral, hiperproteica, com densidade energética normal. Especialmente formulada para auxiliar na cicatrização de lesões por pressão e outras situações que requeiram cicatrização. Isenta de lactose e glúten. Acrescida de arginina e micronutrientes que contribuem para o processo de cicatrização ( ferro, zinco, cobre, selênio, vitaminas A, E e C), além da presença dos exclusivos mix de fibras MF6 e mix de carotenoides (alfa, beta e gama caroteno, licopeno, luteína e zeaxantina). ', 'Isento', '', 1, '2021-11-11 19:09:50'),
(10, 1, 'Fresubin Original', '/fotos_produtos/1637624997__fresubin-original-1000-ml.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"EasyBag de 1000 ml\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Fresenius', '100', '13,8', '3,8', '3,4', '0', 'Risco nutricional ou desnutrição leve, anorexia e convalescência.', 'Fórmula padrão para uso enteral normocalórica e normoproteica, com ômega 3 proveniente da adição de óleo de peixe. Possui 1.000Kcal e 38g de proteína em 1 litro de dieta.', 'Isento.', '', 1, '2021-11-22 20:49:25'),
(11, 1, 'Fresubin 2 Kcal Creme', '/fotos_produtos/1658430560__fff.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Fibras\"]', '[\"125\"]', '[\"Pote\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"2,0\"]', '[\"\"]', '[\"\"]', 'Fresenius', '200', '22,5', '10', '7,8', '0', 'Pacientes idosos e disfagia, restrição hídrica e/ou necessidades elevadas: DPOC, cardiopatias, pacientes renais em tratamento dialítico, desnutrição proteico-calórica', 'Suplementação nutricional oral hipercalórica e hiperproteica com consistência pastosa. Possui 250Kcal e 12,5g de proteína em 1 unidade de 125g.', 'Baunilha, Frutas da Floresta e Praliné', '', 1, '2021-11-22 21:21:16'),
(12, 1, 'Trophic Basic Enteral - 400g', '/fotos_produtos/1649196730__trophic-basic-enteral-400g.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Pó)\"]', '[\"Sem Lactose\",\"100% Proteína Vegetal\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', NULL, '[\"7\",\"9\",\"11\"]', '[\"Colher-medida\",\"Colher-medida\",\"Colher-medida\"]', '[\"54,6\",\"70,2\",\"85,8\"]', '[\"1,0\",\"1,2\",\"1,5\"]', '[\"200\",\"190\",\"175\"]', '[\"250\",\"250\",\"250\"]', 'Prodiet', '435', '60', '16', '14', '0', 'Risco nutricional ou situações de nutrição enteral prolongada.', 'Trophic Basic tem baixo teor de gordura saturada e um mix exclusivo de proteínas que ajudam a promover uma alimentação completa e nutritiva. É ideal para pacientes com distúrbios alimentares, doenças neurológicas ou em recuperação, que precisam restabelecer o estado nutricional. A versão em pó é versátil e permite diferentes diluições de 1,0 a 1,5 kcal/ ml.', 'Baunilha.', 'Dissolver o produto à metade de água filtrada e tratada. Mexa com uma colher até completa homogeneização e complete com o volume de água restante.', 1, '2021-12-16 10:06:07'),
(13, 1, 'Fresubin Protein Powder', '/fotos_produtos/1640726403__fresubin-protein-powder.jpg', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"300\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Fresenius', '360', '0', '87', '0', '0', 'Pacientes com necessidades proteicas elevadas: Desnutrição proteica, idosos com fratura de fêmur, HIV/AIDS, câncer e cirurgia bariátrica.', 'Módulo de proteína para nutrição enteral e oral com 100% de proteína isolada do soro do leite. Não contém glúten.', 'Isento.', 'Via oral: Fresubin® Protein Powder possui sabor neutro, podendo ser adicionado a todo tipo de alimento. Adicionar o volume prescrito (2 a 3 colheres medidas) a alimentos líquidos ou sólidos, doces ou salgados, frios ou quentes (até 70ºC).\r\n\r\nVia enteral: Adicionar o volume prescrito (2 a 3 colheres medida em 50 a 150mL de água fervida e filtrada). Diluir o produto, utilizando uma colher ou garfo e administrar ao paciente de acordo com o protocolo da instituição ou prescrição do nutricionista.', 1, '2021-12-28 18:20:03'),
(14, 1, 'Frebini Energy Drink', '/fotos_produtos/1642969910__frebini-energy-drink-produto.jpg', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Fibras\"]', '[\"200\"]', '[\"EasyBottle\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Fresenius', '150', '18,7', '3,8', '6,7', '0', 'Crianças de 1 a 10 anos com necessidades nutricionais elevadas', 'Suplementação nutricional oral pediátrica hipercalórica e normoproteica. Possui 300Kcal e 7,6g de proteína em 1 unidade de 200mL.', 'Banana e morango', 'Produto pronto para consumo. Agite bem antes de beber. Pode ser consumido em temperatura ambiente, mas gelado é sempre mais gostoso.', 1, '2022-01-08 16:20:14'),
