(57, 1, 'Modulen', '/fotos_produtos/1642768283__modulen.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, '[\"Sem Lactose\",\"Oligomérico\",\"Sem Fibras\"]', '[\"Pó\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"6\"]', '[\"Colher-medida\"]', '[\"50\"]', '[\"1,0\"]', '[\"210\"]', '[\"250\"]', 'Nestlé', '493', '54', '18', '23', '0', 'Pacientes que necessitam de uma nutrição com TGFß-2,\r\nque contribui para a ação anti-inflamatória e reparadora da\r\nmucosa intestinal', 'Fórmula para nutrição enteral ou oral com alto teor de cloreto, zinco, \r\nmolibdênio e vitaminas A, D, E, C e B6. Sem lactose e sem glúten.', 'Sem sabor', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-01-21 09:31:23'),
(58, 1, 'FiberMais - sachês', '/fotos_produtos/1647034882__fibermais-sache.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"50\"]', '[\"Caixa com 10 sachês \"]', '[\"5\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para auxiliar na regularização do trânsito intestinal de adultos e crianças (a partir de 4 anos)', 'Exclusivo mix de fibras solúveis que agem naturalmente contribuindo para o funcionamento do intestino e equilíbrio da microbiota intestinal. Fácil de incluir na rotina pois pode\r\nser adicionado a diversas preparações, doces ou salgadas, quentes ou frias. FiberMais® é um alimento com propriedade funcional, sem contraindicações. \r\n', 'Sem sabor', 'Para beber: coloque uma colher de sopa ou um sachê em um copo, em seguida adicione o líquido, mexendo vigorosamente até a completa dissolução.\r\nPara comer: adicione uma colher de sopa ou um sachê em purês, cremes, iogurtes, vegetais, frutas, massas, ou qualquer alimento de sua preferência e misture bem.\r\n\r\nSugestão de consumo\r\nAdultos: iniciar com uma colher de sopa ou 1 sachê ao dia, progredir até 3 colheres de sopa ou 3 sachês, de acordo com a necessidade e tolerância.\r\nCrianças: utilizar segundo orientação médica e/ou nutricionista', 1, '2022-01-21 09:35:09'),
(59, 1, 'FiberMais Colágeno - sachês', '/fotos_produtos/1647035082__fibermais-colageno-saches.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"60\"]', '[\"Caixa com 10 sachês\"]', '[\"6\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'FiberMais® Colágeno foi desenvolvido especialmente para pessoas que querem se sentir bem, cuidando do intestino e da pele.', 'FiberMais® Colágeno é uma \r\ncombinação única que alia os benefícios das fibras solúveis e do colágeno Verisol®, para auxiliar na manutenção do intestino e da saúde do intestino e da pele. No delicioso sabor de limão, sua combinação de fibras dissolvem completamente para o preparo de bebidas.\r\n', 'Limão', 'Para beber: coloque uma colher de sopa ou um sachê em um copo. Em seguida, adicione 195 mL de água, mexendo vigorosamente até a completa dissolução.\r\n\r\nSugestão de consumo\r\nO consumo deste produto deve ser acompanhado da ingestão de líquidos.\r\nAdultos: 2 colheres de sopa ou 2 sachês ao dia, ou de acordo com a necessidade e tolerância.\r\nCrianças: utilizar segundo orientação médica e/ou nutricionista.', 1, '2022-01-21 09:38:48'),
(60, 1, 'FiberMais Flora', '/fotos_produtos/1642769016__fibermais-flora.jpeg', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"5\"]', '[\"Caixa com 6 sachês\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Auxiliar o equilíbrio da flora intestinal de adultos e crianças (a partir de 4 anos) em situações de disbiose, como\r\ndiarreia.', 'Ação sinérgica entre o probiótico Lactobacillus reuteri e prebiótico para auxiliar o equilíbrio da flora intestinal.\r\nFormulação exclusiva: fonte de fibras solúveis + L. reuteri (108 UFC).\r\n', 'Sem sabor', 'Coloque o conteúdo do sachê em um copo, em seguida adicione o líquido desejado, mexendo vigorosamente até a completa dissolução. Por ser um produto sem sabor, seu uso é versátil: também pode ser adicionado aos alimentos de sua preferência.\r\nConsumir somente a quantidade indicada na embalagem. O consumo deste produto deve ser acompanhado da ingestão de líquidos. NÃO CONSUMIR O PRODUTO COM ALIMENTOS QUENTES (temperatura superior a 40ºC). GESTANTES, NUTRIZES E CRIANÇAS SOMENTE DEVEM\r\nCONSUMIR ESTE PRODUTO SOB ORIENTAÇÃO MÉDICA E/OU\r\nNUTRICIONISTA.\r\n\r\nSugestão de consumo\r\nConforme orientação médica e/ou nutricionista.', 1, '2022-01-21 09:43:36'),
(61, 1, 'FiberMais Geleia - pote', '/fotos_produtos/1647035337__fibermais-geleia-pote.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"190\"]', '[\"Pote\"]', '[\"18\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para auxiliar na regularização do trânsito intestinal', 'Suplemento alimentar de fibras indicado para auxiliar na regularização do trânsito intestinal. Com polpa de ameixa e fibras de origem vegetal, com apenas açúcares naturais das\r\nfrutas.', 'Ameixa', 'Adicione uma colher de sobremesa ao dia (18 g) no alimento de sua preferência. Não exceder a recomendação diária de consumo.', 1, '2022-01-21 09:45:59'),
