(71, 1, 'Nutren Just Protein - lata', '/fotos_produtos/1653399380__nutren-just-protein-lata.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"280\"]', '[\"Lata\"]', '[\"15\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"0,43\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para atendimento das necessidades proteicas.', 'Suplemento alimentar de proteína isolada de soro de leite de vaca (Whey Protein isolado), em pó.', 'Sem sabor', 'Adicione todo o conteúdo do sachê ou 2 colheres de sopa (15 g) em 120 mL de água e agite imediatamente até ficar homogêneo.', 1, '2022-01-21 10:54:46'),
(72, 1, 'Nutren Senior 200mL Mix de frutas', '/fotos_produtos/1642773633__nutren-senior-200ml-mix-de-frutas.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"200\"]', '[\"Garrafinha\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Nestlé', '98', '9,4', '8,0', '3,2', '0,5', 'Especialmente para pessoas com mais de 50 anos que necessitam de auxílio na manutenção dos ossos e músculos, podendo ser uma opção para dietas com restrição de açúcares e lactose.', 'Alimento pronto para consumo, prático e fácil de incluir na rotina. Contém 20 vitaminas e minerais e é rico em cálcio,\r\nfósforo, zinco, cobre, selênio, vitaminas D, E, B6, K e ácido fólico. Sem adição de açúcares, zero glúten e zero lactose.', 'Mix de frutas', '', 1, '2022-01-21 11:00:33'),
(73, 1, 'Nutren Senior 200mL chocolate', '/fotos_produtos/1642773946__nutren-senior-200ml-chocolate.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"200\"]', '[\"Garrafinha\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Nestlé', '98', '9,4', '8,0', '3,2', '0,8', 'Indicado especialmente para pessoas com mais de 50 anos que necessitam de auxílio na manutenção dos ossos\r\ne músculos, podendo ser uma opção para dietas com restrição de açúcares e lactose.', 'Alimento pronto para consumo, prático e fácil de incluir na rotina. Contém 20 vitaminas e minerais e é rico em cálcio,\r\nfósforo, zinco, cobre, selênio, vitaminas D, E, B6, K e ácido fólico. Sem adição de açúcares*, zero glúten e zero lactose.\r\n*Contém açúcares próprios dos ingredientes. Este não é um alimento baixo ou reduzido em valor energético.', 'Chocolate', '', 1, '2022-01-21 11:05:46'),
(74, 1, 'Nutren Senior 200mL baunilha', '/fotos_produtos/1643160743__nutren-senior-200ml-baunilha.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"200\"]', '[\"Garrafinha\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Nestlé', '98', '9,4', '8,0', '3,2', '0,5', 'Para pessoas especialmente depois dos 50 anos, que necessitem de auxílio na manutenção dos ossos e músculos, podendo ser uma opção para dietas com restrição de açúcares e lactose', 'Alimento pronto para consumo, prático e fácil de incluir na rotina. Contém 20 vitaminas e minerais e é rico em cálcio, fósforo, zinco, cobre, selênio, vitaminas D, E, B6, K e ácido fólico. Sem adição de açúcares, zero glúten e zero lactose. Contém aromatizante sintético idêntico ao natural\r\n', 'Baunilha', '', 1, '2022-01-25 22:32:23'),
(75, 1, 'Nutren Senior pó sem sabor 740g', '/fotos_produtos/1653399669__nutren-senior-po-sem-sabor-740g.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"740\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"3\"]', '[\"Colher de sopa\"]', '[\"27,5\"]', '[\"0,58\"]', '[\"180\"]', '[\"200\"]', 'Nestlé', '425,45', '36,3', '36,3', '14,5', '4', 'Como parte de dieta ou para complementação de nutrição diária. Auxilia na manutenção das funções do tecido ósseo e músculo-esquelético', 'Combinação exclusiva de cálcio, proteína e vitamina D, com vitaminas e minerais. Versátil, pode ser adicionado ao final de receitas doces e salgadas.', 'Sem sabor', '3 colheres de sopa rasas (27,5 g) + 180 mL de água ou ao final de receitas doces ou salgadas, 2x ao dia.', 1, '2022-01-25 22:43:13'),
(76, 1, 'Nutren Senior Pó sem sabor zero lactose', '/fotos_produtos/1643499497__nutren-senior-po-sem-sabor-zero-lactose.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"740\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"1\"]', '[\"Colher-medida\"]', '[\"27,5\"]', '[\"0,58\"]', '[\"180\"]', '[\"200\"]', 'Nestlé', '427', '37', '36', '15', '4,0', 'Como parte de dieta ou para complementação da nutrição\r\ndiária. Auxilia na manutenção das funções do tecido ósseo e do músculo-esquelético, para dietas com restrição de lactose', 'Composto lácteo para dietas com restrição de lactose, indicado como parte de dieta ou para complementação da nutrição diária. Auxilia na manutenção das funções do tecido ósseo e do músculo-esquelético. Adicionado de vitaminas, minerais e\r\nfibras. Rico em selênio, vitaminas A, E, C, B1, B12, D e K, fonte de proteínas, cálcio, fósforo, ferro, zinco, cobre, vitaminas B2, B6, biotina e ácido pantotênico. Zero lactose. Zero adição de açúcares e sem glúten. Contém fibras solúveis. ', 'Sem sabor ', '3 colheres de sopa rasas (27,5g) 2x ao dia de Nutren Senior Sem Sabor em Pó Zero Lactose equivalem a 6 colheres diárias (55g)', 1, '2022-01-25 22:57:31'),
(77, 1, 'Fresubin Soya Fibre', '/fotos_produtos/1643217088__fresubin-soya-fibre.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"100% Proteína Vegetal\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"EasyBag\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Fresenius', '100', '12,1', '3,8', '3,6', '2', 'Indicações da dieta padrão, associada à preferência ao uso da proteína vegetal (intolerância à proteína do leite e vegetarianos)', 'Fórmula padrão para uso enteral normocalórica e normoproteica, com ômega 3 proveniente da adição de óleo de peixe. Possui 1.000Kcal e 38g de proteína em 1 litro de dieta. Contém 20g de fibras.', '', 'Siga as orientações de administração prescrita pelo seu Nutricionista ou Médico.', 1, '2022-01-26 14:11:28'),
(78, 1, 'Nutren Fresh', '/fotos_produtos/1643218907__nutren-fresh.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"200\"]', '[\"Garrafinha\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Nestlé', '128', '27', '5,0', '0', '0', 'Para auxiliar na manutenção ou recuperação do estado nutricional e de hidratação de pacientes que necessitem de maior aporte calórico e proteico e/ou com necessidades de\r\nreidratação oral, podendo ser uma opção para dietas com restrição de lactose e gorduras.', 'Alimento pronto para o consumo, clarificado e refrescante, sabor chá de limão. Sem lactose e sem gorduras totais, com 100% Whey Protein isolado do total de proteínas. Rico em\r\nvitaminas B1, B6, C e D, niacina e ácido fólico.', 'Chá de limão', '2 unidades ao dia. Consumir preferencialmente sob\r\norientação de nutricionista ou médico.', 1, '2022-01-26 14:41:47'),
(79, 1, 'Thicken Up Clear', '/fotos_produtos/1658355748__captura-de-tela-2022-07-20-as-19.20.46.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"1,2\"]', '[\"Display com 24 sachês\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para pacientes disfágicos', 'Espessante e gelificante para alimentos que modifica\r\ninstantaneamente a textura e a consistência dos alimentos quentes ou frios, sem alterar cor, sabor e cheiro dos alimentos.', 'Sem sabor', 'Em um recipiente vazio, coloque a quantidade indicada\r\nna tabela de dosagem para obter textura de néctar, mel ou pudim. Acrescente o alimento quente ou frio e mexa vigorosamente.\r\nAlimento: 100 mL de água, sopas e preparações culinárias\r\nNéctar: 1 colher-medida ou 1 sachê\r\nMel: 2 colheres-medida ou 2 sachês\r\nPudim: 3 colheres-medida ou 3 sachês', 1, '2022-01-26 14:45:39'),
(80, 1, 'Compleat Pediatric', '/fotos_produtos/1643219571__compleat-pediatric.jpeg', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Com Fibras\"]', '[\"250\"]', '[\"Tetra Slim\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Nestlé', '104', '14', '3,8', '3,8', '0,8', 'Para crianças de 4 a 10 anos de idade, que necessitam de nutrição enteral/oral', 'Fórmula pediátrica para nutrição enteral e oral, normocalórica (1,0 kcal/mL), com polpa de fruta, vegetais\r\ndesidratados e proteína animal e vegetal. Possui alto teor de cálcio, selênio, biotina, ácido pantotênico e vitaminas C, B1, B2, B6, B12.', 'Sem adição de aromatizante ou corante', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-01-26 14:52:51'),
(81, 1, 'Peptamen® Junior', '/fotos_produtos/1643220303__peptamen-junior.jpeg', '[\"Pediátrico\"]', 'Enteral', '[\"Fechado\"]', NULL, NULL, NULL, '[\"500mL\"]', '[\"Sistema Fechado Smartflex\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Nestlé', '101', '13', '3,0', '4,0', '0,1', 'Para pacientes pediátricos críticos de 4 a 10 anos de idade, com intolerância gastrintestinal e/ou com dificuldade na\r\nabsorção da proteína intacta', 'Fórmula enteral e oral pediátrica à base de peptídeos, normocalórica (1,0 kcal/mL).\r\n', 'Baunilha', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-01-26 15:05:03'),
(83, 1, 'Nutren® Senior Pó Chocolate', '/fotos_produtos/1643500028__nutren-senior-po-chocolate.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', NULL, '[\"740g\"]', '[\"Lata\"]', NULL, 'gramas', '[\"1\"]', '[\"Colher-medida\"]', '[\"31,5\"]', '[\"1,0\"]', '[\"180mL\"]', '[\"200mL\"]', 'Nestlé', '', '', '', '', '', 'Especialmente para pessoas com mais de 50 anos que necessitam de auxílio na manutenção dos ossos e músculos, podendo ser uma opção para dietas com restrição de açúcares.\r\n', 'Combinação exclusiva de cálcio, proteína e vitamina D.\r\nSem adição de açúcares, aliando nutrição ao exclusivo sabor Nestlé.', 'Chocolate', 'Adicione 3 colheres de sopa cheias (31,5 g) em 180 mL de leite desnatado morno ou quente e misture bem até a completa dissolução.', 1, '2022-01-29 20:47:08'),
