(104, 1, 'Alfaré', '/fotos_produtos/1643837947__alfare.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"4,5\"]', 'gramas', '[\"3\"]', '[\"Colher-medida\"]', '[\"13,5\"]', '[\"0,68\"]', '[\"90\"]', '[\"100\"]', 'Nestlé', '501', '55', '14', '25', '0', 'Lactentes e crianças de primeira infância, de 0 a 36 meses de idade, com alergia às proteínas intactas do leite de vaca e soja, com comprometimento do trato gastrintestinal e/ou com\r\nrestrição à lactose', 'Fórmula infantil à base de proteínas de soro do leite extensamente hidrolisadas, com TCM, DHA, ARA e\r\nnucleotídeos. Isento de lactose, sacarose e glúten.', 'Sem sabor\r\n', 'A reconstituição da fórmula é de 1 colher-medida rasa para\r\ncada 30 mL de água. A tabela de alimentação acima é uma\r\nsugestão de consumo.\r\nNão modifique as proporções sem consultar um médico e/ou\r\nnutricionista.\r\nReconstituição com 13,5 g de pó + 90 mL de água = 100 mL.\r\nCapacidade da colher-medida: 4,5 g', 1, '2022-02-02 18:39:07'),
(105, 1, 'Alfamino', '/fotos_produtos/1643838283__alfamino.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"4,6\"]', 'gramas', '[\"3\"]', '[\"Colher-medida\"]', '[\"13,9\"]', '[\"0,7\"]', '[\"90\"]', '[\"100\"]', 'Nestlé', '503', '57', '13', '25', '0', 'Lactentes e crianças de primeira infância, de 0 a 36 meses de idade, com alergia às proteínas do leite de vaca e soja e alergias alimentares mais severas, com comprometimento do trato gastrintestinal e com restrição à lactose', 'Fórmula infantil com 100% de aminoácidos livres, com lipídeos estruturados (β-palmitato), DHA, ARA e TCM. Sem lactose.', 'Sem sabor', 'Reconstituição com 13,9 g de pó + 90 mL de água = 100 mL.\r\nCapacidade da colher-medida: 4,6 g.\r\n', 1, '2022-02-02 18:44:43'),
(106, 1, 'Dianutri', '/fotos_produtos/1644075313__dianutri.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Pó)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', NULL, '[\"8\"]', '[\"Colher-medida\"]', '[\"43,2\"]', '[\"1,0\"]', '[\"100\"]', '[\"200\"]', 'Danone', '465', '49', '18', '24', '7,0', 'Diabetes tipo I e II, Diabetes gestacional, Síndrome metabólica e Intorerância à glicose.', 'Fórmula modificada para nutrição enteral e oral, hiperlipídica, normocalórica e normoproteica, enriquecida com fibras. Especialmente formulada para auxiliar pacientes diabéticos ou intolerância à glicose. Isenta de sacarose e glúten. ', 'Baunilha', 'Dissolver 8 colheres medidas (5,4g) do produto em 100ml de água . Após obter completa homogeneidade, adicionar o restante da água até completar o volume final de 200ml. Dispensa o uso de liquidificador. ', 1, '2022-02-05 12:35:13'),
(107, 1, 'Nutri Dextrin', '/fotos_produtos/1644075629__nutri-dextrin.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"1\"]', '[\"Colher-medida\"]', '[\"6,5\"]', '[\"0,32\"]', '[\"100mL\"]', '[\"100mL\"]', 'Danone', '380', '95', '0', '0', '0', 'Fórmula especialmente elaborada para uso em nutrição oral ou enteral indicada para pacientes com necessidades energéticas aumentadas ou incapazes de atingir suas necessidades calóricas através de uma dieta normal.\r\n', 'Módulo de maltodextrina, carboidrato complexo com excelente digestibilidade, alta solubilidade em água e baixo poder osmótico. Isento de lactose e glúten. \r\n', 'Isento de sabor (não contém edulcorante, corante e aroma).', 'Adicionar uma colher-medida (6,5g) para obter uma porção de 100mL. ', 1, '2022-02-05 12:40:29'),
(108, 1, 'Nutri Diabetic 200mL', '/fotos_produtos/1644076035__nutri-diabetic.png', '[\"Adulto\"]', 'Suplemento', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"200\"]', '[\"Embalagem \"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '100', '9,8', '3,9', '5,1', '1,6', 'Pacientes diabéticos tipo 1 e 2, diabetes gestacional, síndrome metabólica, pacientes hiperglicêmicos. ', 'Fórmula padrão para nutrição enteral e oral, normocalórica e normoproteica, enriquecida com fibras. Especialmente formulada para auxiliar pacientes diabéticos ou hiperglicêmicos. Isenta de lactose, sacarose e glúten. ', 'Baunilha', 'Pronto para consumo. \r\n', 1, '2022-02-05 12:47:15'),
(109, 1, 'Nutri Enteral Soya', '/fotos_produtos/1644091805__nutri-enteral-soya.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetrapack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Danone', '120', '17', '4,4', '4,0', '0', 'Desnutrição, anorexia nervosa, neoplasias, cardiopatias, doenças neurológicas.', 'Fórmula padrão para nutrição enteral ou oral, nutricionalmente completo, com densidade energética normal (1,2kcal/ml), normoproteico e hipossódico.', 'Baunilha', 'Manter a embalagem fechada à temperatura ambiente em local seco e fresco. Após aberta, conservar devidamente tampada e sob refrigeração por no máximo 24 horas.\r\n\r\n', 1, '2022-02-05 17:10:05'),
