(111, 1, 'Nutri Enteral 1.5 baunilha', '/fotos_produtos/1656160690__nutri-enteral-1-5-sabor-baunilha-danone-nutrimed-53-1-20190930154854.webp', '[\"Adulto\"]', 'Suplemento', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Fibras\"]', '[\"200\"]', '[\"Tetra Pak\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Danone', '150', '22', '6,2', '4,2', '0', 'Pacientes em risco nutricional ou desnutridos. Pacientes com necessidades nutricionais aumentadas ou restrição de volume.', 'Fórmula padrão para nutrição enteral e oral, hipercalórica e normoproteica. Especialmente formulada para auxiliar pacientes com necessidades energéticas elevadas ou restrição de volume. Isenta de lactose, sacarose, glúten e fibras. Com baixo teor de gordura saturada. ', 'Baunilha', 'Agite bem antes de beber. Pronta para consumo. Acompanha canudo. O volume e velocidade de infusão da fórmula devem ser ajustados conforme a necessidade e a tolerância do paciente sob supervisão de nutricionista ou médico.', 1, '2022-02-09 18:55:18'),
