(114, 1, 'Nutri Enteral Soya Pó', '/fotos_produtos/1644452972__nutri-enteral-soya-po.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Pó)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"800\"]', '[\"Lata\"]', '[\"\"]', NULL, '[\"9\",\"11\",\"14\"]', '[\"Colher-medida\",\"Colher-medida\",\"Colher-medida\"]', '[\"45\",\"55\",\"70\"]', '[\"1,0\",\"1,2\",\"1,5\"]', '[\"50\",\"100\",\"100\"]', '[\"200\",\"200\",\"200\"]', 'Danone', '451', '62', '17', '15', '0', 'Desnutrição, anorexia nervosa, neoplasias, cardiopatias, doenças neurológicas.', 'Fórmula padrão para nutrição enteral ou oral em pó, nutricionalmente completa, com densidade energética normal (1,0kcal/ml podendo chegar a 1,5 kcal/ml de acordo com a diluição da lata) dieta sem fibras, normoproteica, normolipídica e hipossódica.', 'Baunilha', 'Diluir o produto em 50mL de água. Adicionar mais água até completar o volume final de 200mL, misture até a completa homogeneização. A quantidade de pó depende da densidade calórica desejada. ', 1, '2022-02-09 21:29:32'),
(115, 1, 'Nutri Fiber', '/fotos_produtos/1644453656__nutri-fiber.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Danone', '150', '22', '6,2', '4,2', '2,3', 'Desnutrição, anorexia nervosa, neoplasias, cardiopatias, doenças neurológicas, associadas à necessidade de fibras (regularização do trânsito intestinal).', 'Fórmula padrão para nutrição enteral ou oral, nutricionalmente completo, normocalórico (1,2kcal/ml), com fibras e com adequado perfil proteico e lipídico.', 'Isento (não contém edulcorante, corante e aroma)', 'Conservar a embalagem fechada a temperatura ambiente em local fresco e seco. Após aberto, conservar devidamente tampadas e sob refrigeração por no máximo 24 horas.\r\nUso somente sob recomendação de médico ou nutricionista.', 1, '2022-02-09 21:40:56'),
(116, 1, 'Nutri Fiber 1.5', '/fotos_produtos/1652380889__nutri-renal.jpg', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Danone', '150', '22', '6,2', '4,2', '2,3', 'Pacientes em risco nutricional ou desnutridos. Pacientes com necessidades nutricionais aumentadas ou restrição de volume, que necessitem de regularização do trânsito intestinal. \r\n', 'Fórmula padrão para nutrição enteral e oral, hipercalórica e normoproteica. Especialmente formulada para auxiliar pacientes com necessidades energéticas elevadas ou restrição de volume que necessitem de regularização do trâncisto intestinal. Com baixo teor de gordura saturada e é enriquecida com exclusivo mix de fibras MF6. ', 'Baunilha', 'Agitar bem antes de usar. Independentemente do tipo de dieta que você vai utilizar, a administração deve ser feita à temperatura ambiente.\r\n\r\n\r\nModo de administração: O volume e velocidade de infusão da fórmula devem ser ajustados conforme a necessidade e a tolerância do paciente sob supervisão do médico e ou nutricionista. Pode ser consumido à temperatura ambiente ou gelado. O armazenamento e uso inadequados deste produto podem trazer perigos à saúde do paciente.\r\n\r\n\r\nUSAR SOMENTE SOB ORIENTAÇÃO MÉDICA OU DE NUTRICIONISTA. PROIBIDO O USO POR VIA PARENTERAL.', 1, '2022-02-09 21:47:29'),
(117, 1, 'Nutri HWhey', '/fotos_produtos/1655499344__nutri-hwhey.jpg', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"250\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"1\"]', '[\"Colher-medida\"]', '[\"4,5\"]', '[\"0,17\"]', '[\"100\"]', '[\"100\"]', 'Danone', '378', '3,9', '80', '4,7', '0', 'Pacientes com necessidades proteicas elevadas, desnutrição proteica, sepse, infecção, pacientes queimados e com câncer.', ' Módulo de proteínas (100% proteína hidrolisada do soro do leite) para nutrição enteral ou oral.\r\n', 'Isento de sabor', 'Dissolver 1 colher medida do produto em 100mL de água. Dissolver bem até a completa homogeneização. Dispensa o uso de liquidificador.', 1, '2022-02-09 21:52:42'),
(118, 1, 'Nutri Renal', '/fotos_produtos/1655499176__nutri-renal-sabor-baunilha-1l.webp', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"2,0\"]', '[\"\"]', '[\"\"]', 'Danone', '200', '32', '3,3', '6,7', '0', 'Pacientes renais em tratamento conservador. Insuficiência renal aguda ou crônica.', 'Fórmula modificada para nutrição enteral ou oral, formulado para pacientes com função renal comprometida. Hipercalórico (2,0kcal/ml), nutricionalmente completo, com baixo teor proteico, adicionado de taurina (13,8mg/100ml) e carnitina (13,8mg/100ml) e com perfil lipídico de acordo com ADA e AHA.', 'Baunilha', 'Agite bem antes de beber. Pronto para consumo. Acompanha canudo.\r\n\r\nO volume e velocidade de infusão da fórmula devem ser ajustados conforme a necessidade e a tolerância do paciente sob supervisão de nutricionista ou médico.', 1, '2022-02-09 22:00:45'),
(119, 1, 'Nutri Renal D - 200mL', '/fotos_produtos/1649195708__nutri-renal-d-200ml.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"200\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"2,0\"]', '[\"\"]', '[\"\"]', 'Danone', '200', '28', '7,5', '6,6', '0', 'Pacientes com insuficiência renal aguda ou crônica em tratamento dialítico, com restrição de eletrólitos e fluidos.', 'Fórmula modificada para nutrição enteral ou oral, formulado para pacientes com função renal comprometida em diálise. Hipercalórico (2,0kcal/ml), nutricionalmente completo, normoproteico e com perfil lipídico de acordo com ADA e AHA.\r\n', 'Baunilha', 'Manter a embalagem fechada à temperatura ambiente em local seco e fresco. Após aberta, conservar devidamente tampada e sob refrigeração por no máximo 24 horas. Nunca utilize produtos com data de validade vencida.', 1, '2022-02-09 22:09:15');
