(120, 1, 'Instanth Clear', '/fotos_produtos/1644597666__instanth-clear.jpg', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"125\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Pacientes com dificuldade de deglutição / disfagia.', 'Instanth Clear é um espessante para alimentos desenvolvido com maltodextrina e gomas alimentícias. É sem sabor, não altera a cor, aroma nem sabor. Pode ser adicionado em líquidos quentes ou frios, conferindo a consistência desejada.', 'Sem sabor', 'Sugestão de Preparações / Diluições:\r\n\r\nNéctar: Adicione 1 colher medidora (1g) em 100 ml do líquido desejado, mexendo sempre até a mistura se dissolver por completa.\r\n\r\nMel: Adicione 02 colheres medidoras (2g) em 100 ml do líquido desejado, mexendo sempre até a mistura se dissolver por completa.\r\n\r\nPudim: Adicione 04 colheres medidoras (4g) em 100 ml do líquido desejado, mexendo sempre até a mistura se dissolver por completa.\r\n\r\nRendimento: 01 lata rende cerca de 125 porções de 1g para 100 ml de líquidos. (No Perfil Néctar)', 1, '2022-02-11 13:41:06'),
(121, 1, 'Instanth Neo', '/fotos_produtos/1644597790__instanth-neo.jpg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Sem Fibras\"]', '[\"13,75\"]', '[\"Display - 37 sachês\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Instanth NEO é um suplemento em pó com ingredientes específicos que devem ser consumidos mediante orientação de profissional de saúde.', 'Instanth NEO é a combinação exclusiva de nutrientes: ácido cáprico, ácido caprílico, fosfatidilserina, DHA e vitaminas D e B12.', 'Sem sabor', 'Cada sachê pode ser diluído em 20 ml de água ou adicionado a sucos, iogurtes, leite e sopas. Na fase de adaptação a sugestão é consumir o produto após as refeições.', 1, '2022-02-11 13:43:10'),
(122, 1, 'Immax - 350g ', '/fotos_produtos/1644598417__inmax.jpg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"350\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"6\"]', '[\"Colher-medida\"]', '[\"51,6\"]', '[\"1,0\"]', '[\"160\"]', '[\"200\"]', 'Prodiet', '393', '50', '25', '9,0', '6,0', 'Ideal para pacientes oncológicos. Alterações no apetite e no paladar. Necessidade elevada de proteínas.', 'O IMMAX possui nutrientes fortificantes, que adicionados às receitas doces e salgadas do dia a dia, enriquecem a alimentação e não alteram o sabor, proporcionando qualidade de vida e bem-estar.\r\n\r\nAlém disso, IMMAX é hiperproteico e acrescido de L-leucina, importantes no crescimento muscular.', 'Sem sabor', 'Dissolver em água filtrada e tratada (temperatura ambiente) até completa homogeneização. Pode ser adicionado ao final de receitas doces e salgadas.', 1, '2022-02-11 13:53:37'),
(123, 1, 'HDMax', '/fotos_produtos/1644598846__hd-max.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"200\"]', '[\"Tetra Pak\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Prodiet', '150', '20', '6,7', '4,6', '2,0', 'Recuperação nutricional de pacientes em processo dialítico.\r\n\r\n', 'HDmax é ideal para repor os nutrientes perdidos durante a diálise. Sem adição de açúcares e restrito em Sódio, Potássio, Fósforo e Magnésio, ele garante uma nutrição balanceada e muita energia!\r\n\r\nHDmax é pronto para beber, sabor baunilha, perfeito para substituir aquele lanche durante e após a diálise.', 'Baunilha', 'Pronto para consumo, acompanha canudo.\r\n', 1, '2022-02-11 14:00:46'),
(124, 1, 'Peptimax', '/fotos_produtos/1644599239__peptimax.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Pó)\"]', '[\"Sem Sacarose\",\"Oligomérico\",\"Sem Fibras\"]', NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', NULL, '[\"7\"]', '[\"Colher-medida\"]', '[\"59,5\"]', '[\"1,0\"]', '[\"200\"]', '[\"250\"]', 'Prodiet', '406', '63', '18', '10', '0', 'Distúrbios digestivos e absortivos e desmame de nutrição parenteral.', 'Peptimax é uma fórmula oligomérica, ideal para minimizar transtornos intestinais como diarreias agudas e distúrbios digestivos, proporcionando rápida absorção de nutrientes e contribuindo para fortalecer o sistema imunológico.\r\n\r\nPeptimax possui L-Glutamina, que promove o bom funcionamento do intestino, e que, combinado com a Proteína Hidrolisada do Soro do Leite e TCM, promove mais nutrição, energia e bem-estar aos pacientes.', 'Baunilha', 'Dissolver em água filtrada e tratada (temperatura ambiente) até completa homogeneização.', 1, '2022-02-11 14:07:19'),
(125, 1, 'Trophic Basic', '/fotos_produtos/1644600603__trophic-basic.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Prodiet', '120', '16', '4,6', '4,1', '0', 'Risco nutricional ou situações de nutrição enteral prolongada.\r\n\r\n', 'Trophic Basic é indicado para a melhoria ou manutenção do estado nutricional de pacientes com distúrbios alimentares, desnutrição, doenças neurológicas ou em recuperação de enfermidades e cirurgias. Com um mix exclusivo de proteínas e baixo teor de gordura saturada, a sua fórmula contém 1.200 calorias por litro e pode ser consumida por longos períodos.', 'Baunilha', 'Pronto para Consumo', 1, '2022-02-11 14:30:03'),
(126, 1, 'Trophic EP', '/fotos_produtos/1644601048__trophic-ep.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Prodiet', '150', '19', '6,9', '5,0', '0', 'Necessidade elevada de proteínas, ideal para pacientes com caquexia ou câncer.', 'EP são as iniciais de Energia e Proteína, presentes em alta quantidade nesta fórmula nutricionalmente completa e isenta de sacarose, lactose e glúten. O Trophic EP é ideal para pacientes cuja necessidade de proteínas é elevada e a absorção energética requer mais velocidade.', 'Baunilha', 'Pronto para o consumo.\r\n\r\n', 1, '2022-02-11 14:37:28'),
(127, 1, 'EnergyZip', '/fotos_produtos/1650048518__energyzip.webp', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Fibras\"]', '[\"200\"]', '[\"Tetra Pak\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Prodiet', '150', '20', '5,7', '5,1', '0', 'Risco nutricional, caquexia, câncer, AIDS e lesão por pressão.', 'EnergyZip é um verdadeiro lanche enriquecido com calorias, vitaminas e proteínas, ideal para quem precisa de um maior aporte calórico. Além de ajudar no ganho de peso, na melhoria do apetite e no aumento da força muscular, é prático e vem pronto para beber!', 'Baunilha, morango e chocolate', 'Pronto para o consumo', 1, '2022-02-11 14:43:55'),
