(129, 1, 'Sustenlac', '/fotos_produtos/1644602413__sustenlac.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"4\"]', '[\"Colher de sopa\"]', '[\"40\"]', '[\"\"]', '[\"200mL\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Alimentação balanceada, reposição diária de nutrientes.', 'Sustenlac é um complemento lácteo com 25 vitaminas e minerais em três sabores: chocolate, morango e baunilha.\r\nCombine com uma alimentação equilibrada e tenha uma vida mais saudável.', 'Baunilha, Morango e Chocolate', 'Dissolver em leite integral até completa homogeneização.', 1, '2022-02-11 15:00:13'),
(130, 1, 'Enterfiber Prebiotic', '/fotos_produtos/1644602655__enterfiber-prebiotic.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"5\"]', '[\"Caixa display - 10 sachês\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Necessidade de complementação diária de fibras solúveis.\r\n\r\n', 'EnterFiber Prebiotic enriquece a alimentação com polidextrose e frutooligossacarídeos (FOS) que são reconhecidas como fibras prebióticas que auxiliam na redução do desconforto abdominal e promovem o equilíbrio da flora intestinal melhorando a imunidade.', 'Sem sabor', 'Enterfiber Prebiotic é sem sabor e pode ser adicionado a preparações diversas, doces ou salgadas. Misture o sachê em água, sucos, iogurtes ou sopas, conforme preferência.\r\n\r\nRecomenda-se o consumo de 3 sachês ao dia para adultos ou conforme indicação do profissional.', 1, '2022-02-11 15:04:15'),
(131, 1, 'Enterfiber', '/fotos_produtos/1644603052__enterfiber.png', NULL, 'Módulo', NULL, NULL, NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Transtornos gastrintestinais.\r\n\r\n', 'EnterFiber enriquece a alimentação com fibras solúveis e insolúveis que ajudam no equilíbrio do intestino, proporcionando bem-estar e qualidade de vida. Pode ser adicionado a diversos preparos sem alterar o sabor dos alimentos.\r\n\r\n1 colher de sopa (aprox. 13g) proporciona 11g de fibras, sendo 7g de fibra solúvel e 4g de fibra insolúvel.', 'Sem sabor', 'Dissolver em água filtrada e tratada (temperatura ambiente) até completa homogeneização. Pode ser acrescido em preparações variadas.\r\n\r\n', 1, '2022-02-11 15:10:52'),
