(133, 1, 'ProteinPT Whey', '/fotos_produtos/1644603257__proteinpt-whey.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"15\"]', '[\"Display - 10 sachês\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Necessidade elevada de proteína.', 'ProteinPT® Whey é ideal para incluir mais proteínas no seu dia a dia e auxiliar na formação dos músculos e ossos. É fácil incluir ProteinPT® Whey na sua rotina, pois não altera o sabor dos alimentos. Pode ser adicionado a sucos, sopas, iogurtes e outros alimentos de sua preferência.', 'Sem sabor', 'Misture o conteúdo do sachê de ProteinPT® Whey (15 g) ao volume desejado de água ou no alimento de sua preferência. Mexa com uma colher até dissolver totalmente. Sugerimos a diluição de 1 sachê em 200 ml de água.', 1, '2022-02-11 15:14:17'),
