(143, 1, 'Nutilis', '/fotos_produtos/1644765901__nutilis-clear.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"300\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '', '', '', '', '', 'Casos de disfagia (dificuldade de deglutição). Confere aos alimentos a consistência desejada: xarope, cremosa ou pudim.', 'Espessante alimentar à base de amido de milho modificado e gomas (tara, xantana e guar). Não contém glúten.', 'Sem sabor', 'Para obter a consistência desejada, adicionar o número de colheres-medidas de Nutilis, conforme indicado abaixo:\r\n200ml bebidas ou sopas + 2-3 medidas - consistência de xarope\r\n200ml bebidas ou sopas + 3-4 medidas - consistência cremosa\r\n200ml bebidas ou sopas + 4-5 medidas - consistência de pudim\r\n200ml + suplementos nutricionais + 2-4 medidas - consistência de xarope\r\n200ml + suplementos nutricionais + 4-5 medidas - consistência cremosa\r\n200ml + suplementos nutricionais + 5-7 medidas - consistência de pudim\r\n100g refeições trituradas + 1 medida = consistência cremosa\r\n100g refeições trituradas + 1,5 medida = consistência de pudim', 1, '2022-02-13 12:20:45'),
(144, 1, 'Nutilis Clear', '/fotos_produtos/1644765844__nutilis-clear.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"175\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '', '', '', '', '', 'Indicado para todos os casos de dificuldade de deglutição (disfagia), como nos casos de disfagia pós-AVC, Parkinson, cirurgia e câncer de cabeça e pescoço, entre outras.', 'Espessante alimentar que não altera cor, odor e sabor dos alimentos. ', 'O produto não apresenta sabor.', 'Para obter a consistência desejada, adicionar o número de colheres-medida de Nutilis Clear conforme indicado abaixo:\r\nQuantidade aproximada a espessar de 200mL\r\nQuantidade de néctar: 1/2 colher méida\r\nConsistência de mel: 1 colher média\r\nConsistência de pudim: 2 colheres média', 1, '2022-02-13 12:24:04'),
