(151, 1, 'Nutrison - Tetra Pack 1000ml', '/fotos_produtos/1644881878__nutrison.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '100', '12', '4,0', '3,9', '0', 'Pacientes em risco nutricional ou desnutridos, com necessidade de nutrição via enteral, como pacientes neurológicos e idosos.', 'Fórmula padrão para nutrição enteral, normocalórica e normoproteica. Especialmente formulada para auxiliar pacientes em risco nutricional ou desnutridos, com necessidade de nutrição enteral. Isenta de lactose, sacarose, glúten e fibras. Contém a mistura de quatro proteínas de alto valor biológico e mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA). Enriquecido com mix de carotenoides.', 'Sem sabor', 'Via sonda: pronto para uso. Gire a tampa para abrir a embalagem. Feche e agite bem antes de usar. Abra a embalagem e adicione no frasco descartável a quantidade de acordo com o volume prescrito por médico ou nutricionista. O volume e velocidade de infusão da fórmula devem ser ajustados conforme a necessidade e a tolerância do paciente sob supervisão do médico ou nutricionista.\r\n\r\nUSAR SOMENTE SOB ORIENTAÇÃO MÉDICA OU DE NUTRICIONISTA. PROIBIDO O USO POR VIA PARENTERAL.', 1, '2022-02-14 20:37:58'),
(152, 1, 'Nutrison Advanced Cubison - Pack 1000ml ', '/fotos_produtos/1644882519__nutrison-advanced-cubison.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '100', '12', '5,5', '3,3', '1,5', 'Cicatrização de lesões por pressão e outras situações que requeiram cicatrização.', 'Fórmula modificada para nutrição enteral, hiperproteica, com densidade energética normal. Especialmente formulada para auxiliar na cicatrização de lesões por pressão e outras situações que requeiram cicatrização. Isenta de lactose e glúten. Acrescida de arginina e micronutrientes que contribuem para o processo de cicatrização ( ferro, zinco, cobre, selênio, vitaminas A, E e C), além da presença dos exclusivos mix de fibras MF6 e mix de carotenoides (alfa, beta e gama caroteno, licopeno, luteína e zeaxantina). ', 'Isento', '', 1, '2022-02-14 20:48:39'),
