(154, 1, 'Nutrison Advanced Diason Energy HP', '/fotos_produtos/1656266533__nutrison-advanced-diason-energy-hp-pack-1000ml-danone-8377-1-483599cd8cac9b78a9f36950fc8adf06.webp', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '147', '12', '7,7', '7,7', '1,5', 'Pacientes graves hiperglicêmicos ou diabéticos.', 'Fórmula modificada para nutrição enteral, com alta densidade energética, hiperproteica e hiperlipídica. Especialmente formulada para atender à demanda de pacientes graves hiperglicêmicos ou diabéticos. Isenta de sacarose, lactose e glúten. Contém alto teor de gorduras monoinsaturadas, baixo teor de gorduras saturadas e mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA). Enriquecido com mix de carotenoides e mix de fibras - MF6, que contribui para o controle glicêmico e promove ação prebiótica.', 'Sem sabor.', 'Conservar em local seco e fresco. Após aberto, o produto deve ser tampado e mantido sob refrigeração por até 24 horas\r\n', 1, '2022-02-14 21:04:41'),
