(195, 1, 'Neo Spoon', '/fotos_produtos/1645383183__neo-spoon.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '', '', '', '', '', 'Na introdução de alimentos sólidos para crianças com alergias alimentares (à proteína do leite de vaca, à soja, a proteína hidrolisada e a múltiplas proteínas). Faixa etária: a partir do 6º mês ', 'Mistura para o preparo de mingau para dietas com restrição de proteínas e hidrolisadas a base de aminoácidos livres 100% não alergênico. Neo Spoon deve ser preparado imediatamente antes do consumo. Neo Spoon pode ser utilizado no preparo de frutas ou hortaliças, conforme orientações do médico e/ou nutricionista.', 'Sem aromatizantes, corantes artificiais e conservantes.', '6-12 meses: 6 colheres-medida (75 mingau) para 50mL de água\r\n1 a 3 anos: 8 colheres-medida (97g mingau) para 60mL de água\r\nCada colher-medida corresponde a 4,6g de Neospoon.', 1, '2022-02-20 15:53:03'),
