(197, 1, 'Neoforte Baunilha', '/fotos_produtos/1647293490__neoforte-baunilha.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"2,5\"]', '[\"Colher-medida\"]', '[\"21,3\"]', '[\"1,0\"]', '[\"80mL\"]', '[\"100mL\"]', 'Danone', '459', '51', '16', '21', '1,9', 'Para crianças com alergias alimentares (à proteína do leite de vaca, à soja, a hidrolisados e a múltiplas proteínas).', 'Alimento para Situações Metabólicas Especiais para Nutrição Enteral/ Oral, sabor artificial de baunilha formulado para portadores de alergia às proteínas do leite de vaca. Neoforte deve ser preparado imediatamente antes do consumo com água fria previamente fervida. Neoforte pode ser consumido junto com frutas ou hortaliças, conforme orientação de médico e/ou nutricionista.\r\n', 'Baunilha', 'Cada colher-medida corresponde a 8,2g. \r\n3 colheres-medida (24g) + 90mL de água = 110mL\r\n4 colheres-medida (32g) + 120mL de água = 150mL\r\n5 colheres-medida (40g) + 150mL de água = 190mL\r\n6 colheres-medida (48g) + 180mL de água = 230mL\r\n7 colheres-medida (56g) + 210mL de água = 270mL', 1, '2022-02-20 20:29:00'),
