(199, 1, 'Nutrini Max Multi Fiber', '/fotos_produtos/1645400754__nutrini-max-multi-fiber.png', '[\"Pediátrico\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"500\"]', '[\"Garrafa plástica\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Danone', '102', '12', '3,3', '4,2', '1,1', 'Para pacientes pediátricos, com necessidade de nutrição enteral, que se beneficiem no uso de fibras 1,2.', 'Fórmula pediátrica para nutrição enteral, especialmente desenvolvida para crianças de 7 a 10 anos de idade. Dieta nutricionalmente completa, normocalórica e normoproteica, enriquecida com o exclusivo mix de carotenoides e com o exclusivo MF6, mix com 50% de fibras solúveis e 50% insolúveis. Baixa osmolaridade.', '', '', 1, '2022-02-20 20:45:54'),
