(218, 1, 'Novasource GC - tetra square 1000ml', '/fotos_produtos/1647034453__novasource-gc-tetrasquare.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Square \"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,1\"]', '[\"\"]', '[\"\"]', 'Nestlé', '112', '9,5', '4,9', '6,0', '1,5', 'Pacientes com necessidade de controle glicêmico', 'Fórmula modificada para nutrição enteral e oral. Normocalórica, normoproteica e hiperlipídica, com caseinato de cálcio e sódio obtidos do leite de vaca, fibras, vitaminas e minerais. Sem adição de sacarose, isento de lactose e glúten.\r\n', 'Baunilha (Tetra Square 1 L)\r\n', '', 1, '2022-03-04 15:04:46'),
(219, 1, 'Novasource GI Control - tetra square', '/fotos_produtos/1647034655__novasource-gi-control-tetrapak.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Square\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Nestlé', '150', '18', '6,0', '6,0', '2,0', 'Pacientes com diarreia aguda ou crônica que necessitam de fibras solúveis e maior aporte calórico.', 'Fórmula modificada para nutrição enteral e oral, com 100% fibras solúveis (20 g/L), hipercalórica e hiperlipídica. Isenta de lactose.', 'Baunilha', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-03-04 15:05:10'),
(220, 1, 'FiberMais - lata', '/fotos_produtos/1647034961__fibermais-lata.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"260\"]', '[\"Lata\"]', '[\"5\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para auxiliar na regularização do trânsito intestinal de adultos e crianças (a partir de 4 anos)', 'Exclusivo mix de fibras solúveis que agem naturalmente contribuindo para o funcionamento do intestino e equilíbrio da microbiota intestinal. Fácil de incluir na rotina pois pode\r\nser adicionado a diversas preparações, doces ou salgadas, quentes ou frias. FiberMais® é um alimento com propriedade funcional, sem contraindicações. \r\n', 'Sem sabor', 'Para beber: coloque uma colher de sopa ou um sachê em um copo, em seguida adicione o líquido, mexendo vigorosamente até a completa dissolução.\r\nPara comer: adicione uma colher de sopa ou um sachê em purês, cremes, iogurtes, vegetais, frutas, massas, ou qualquer alimento de sua preferência e misture bem.\r\n\r\nSugestão de consumo\r\nAdultos: iniciar com uma colher de sopa ou 1 sachê ao dia, progredir até 3 colheres de sopa ou 3 sachês, de acordo com a necessidade e tolerância.\r\nCrianças: utilizar segundo orientação médica e/ou nutricionista', 1, '2022-03-04 15:05:29'),
(221, 1, 'FiberMais Colágeno - lata', '/fotos_produtos/1653397873__fibermais-colageno-lata.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"300\"]', '[\"Lata\"]', '[\"6\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'FiberMais® Colágeno foi desenvolvido especialmente para pessoas que querem se sentir bem, cuidando do intestino e da pele.', 'FiberMais® Colágeno é uma \r\ncombinação única que alia os benefícios das fibras solúveis e do colágeno Verisol®, para auxiliar na manutenção do intestino e da saúde do intestino e da pele. No delicioso sabor de limão, sua combinação de fibras dissolvem completamente para o preparo de bebidas.\r\n', 'Limão', 'Para beber: coloque uma colher de sopa ou um sachê em um copo. Em seguida, adicione 195 mL de água, mexendo vigorosamente até a completa dissolução.\r\n\r\nSugestão de consumo\r\nO consumo deste produto deve ser acompanhado da ingestão de líquidos.\r\nAdultos: 2 colheres de sopa ou 2 sachês ao dia, ou de acordo com a necessidade e tolerância.\r\nCrianças: utilizar segundo orientação médica e/ou nutricionista.', 1, '2022-03-04 15:05:46'),
(222, 1, 'Isosource Mix - tetra square', '/fotos_produtos/1647035550__isosource-mix-tetra-square.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Square \"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Nestlé', '123', '16', '4,3', '4,6', '1,5', 'Na manutenção ou recuperação do estado nutricional de pacientes que necessitam da adição de um mix de fibras', 'Fórmula padrão para nutrição enteral e oral, normocalórica, normoproteica\r\ne normolipídica, com fibras, vitaminas e minerais. Sem adição de sacarose, isenta de lactose e glúten.\r\n', 'Artificial de baunilha', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-03-04 15:06:08'),
(223, 1, 'Isosource 1.5 sem fibras', '/fotos_produtos/1642771261__isosource-1.5-sem-fibras.jpeg', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Sistema Fechado\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Nestlé', '150', '21', '6,3', '4,5', '0', 'Na manutenção ou recuperação do estado nutricional de pacientes com maiores necessidades calóricas e/ou com restrição de volume e de fibras.', 'Fórmula padrão para nutrição enteral e oral, hipercalórica. Sem adição de sacarose, isenta de lactose e glúten. Sem fibras.\r\n', 'Artificial de baunilha', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-03-04 15:06:27'),
(224, 1, 'Novasource Senior - tetra square', '/fotos_produtos/1647035952__novasource-senior-caixa.png', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Square \"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Nestlé', '124', '14', '6,5', '4,7', '0', 'Na manutenção ou recuperação do estado nutricional de pacientes que necessitam de um maior aporte proteico.', 'Fórmula modificada para nutrição enteral e oral, hiperproteica, normocalórica e normolipídica, fonte de cálcio e ferro e alto teor de vitaminas C e D. Sem adição de sacarose, isento de lactose e glúten.', 'Artificial de baunilha', 'Usar somente sob orientação médica e/ou de nutricionista.\r\nProibido o uso por via parenteral.', 1, '2022-03-04 15:06:46'),
(225, 1, 'Nutren Just Protein - sachê', '/fotos_produtos/1653399417__nutren-just-protein-sache.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"15\"]', '[\"Sachê\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"0,43\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para atendimento das necessidades proteicas.', 'Suplemento alimentar de proteína isolada de soro de leite de vaca (Whey Protein isolado), em pó.', 'Sem sabor', 'Adicione todo o conteúdo do sachê ou 2 colheres de sopa (15 g) em 120 mL de água e agite imediatamente até ficar homogêneo.', 1, '2022-03-04 15:07:03'),
(226, 1, 'Nutren Senior pó chocolate 370g', '/fotos_produtos/1643677848__nutren-senior-po-chocolate.jpg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"370\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"3\"]', '[\"Colher-medida\"]', '[\"31,5\"]', '[\"0,65\"]', '[\"180\"]', '[\"200\"]', 'Nestlé', '409,5', '34,9', '34,9', '13,9', '6,0', 'Especialmente para pessoas com mais de 50 anos que necessitam de auxílio na manutenção dos ossos e músculos, podendo ser uma opção para dietas com restrição de açúcares.', 'Combinação exclusiva de cálcio, proteína e vitamina D.\r\nSem adição de açúcares, aliando nutrição ao exclusivo\r\nsabor Nestlé.\r\n', 'Chocolate', 'Adicione 3 colheres de sopa cheias (31,5 g) em 180 mL de leite desnatado morno ou quente e misture bem até a completa dissolução.\r\n', 1, '2022-03-04 15:07:24'),
(227, 1, 'Nutridrink Compact - chocolate', '/fotos_produtos/1647180206__nutridrink-compact-chocolate.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Fibras\"]', '[\"125\"]', '[\"Garrafa plástica\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"2,4\"]', '[\"\"]', '[\"\"]', 'Danone', '240', '30', '9,6', '9,3', '0', 'Desnutrição ou risco nutricional, pré e pós operatório, pacientes com restrição de volume e necessidades calóricas aumentadas. Excelente para paciente com baixa aceitação à terapia nutricional oral, comum nas seguintes situações: idosos, pacientes com dieta oral da UTI, oncologia, fibrosa cística.', 'Fórmula modificada para nutrição enteral e oral, hipercalórica, normoproteica. Alta densidade calórica em pequeno volume. Isenta de glúten. ', 'Chocolate', 'Pronto para consumo.', 1, '2022-03-04 15:07:43'),
(229, 1, 'Trophic 1.5 - 1L', '/fotos_produtos/1647357914__trophic-1.5.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, '[\"Sem Sacarose\",\"Sem Lactose\",\"Sem Fibras\"]', '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Prodiet', '150', '20', '5,7', '5,1', '0', 'Necessidade elevada de calorias associada ou não à restrição hídrica.', 'Um litro de Trophic 1.5 contém 1.500 calorias: concentração ideal para a recuperação ou manutenção do bom estado nutricional de pacientes com doenças neurológicas ou desnutrição, cuja necessidade energética é elevada. A fórmula deste produto é nutricionalmente completa e possui um exclusivo mix de proteínas que oferecem mais força ao organismo.', 'Baunilha', 'Pronto para consumo ', 1, '2022-03-15 12:25:14'),
(230, 1, 'Trophic Fiber - 250mL', '/fotos_produtos/1649196052__trophic-fiber-250ml.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"250\"]', '[\"Tetra Pak\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,2\"]', '[\"\"]', '[\"\"]', 'Prodiet', '120', '17', '4,5', '3,9', '2,0', 'Transtornos gastrintestinais e situações de nutrição enteral prolongada.', 'Com 15 gramas de fibras por litro, o Trophic Fiber auxilia no trânsito intestinal e no equilíbrio da microbiota. Sua fórmula nutricionalmente completa, com mix exclusivo de proteínas, é ideal para pacientes com transtornos gastrointestinais e situação de nutrição enteral prolongada.', 'Baunilha', '', 1, '2022-03-15 12:31:57'),
(231, 1, 'Trophic Fiber pó - 400g', '/fotos_produtos/1647359011__trophic-fiber-400g.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"8\"]', '[\"Colher-medida\"]', '[\"64\"]', '[\"1,0\"]', '[\"200mL\"]', '[\"250mL\"]', 'Prodiet', '402', '55', '16', '13', '6,0', 'Transtornos gastrintestinais e situações de nutrição enteral prolongada.\r\n\r\n', 'O Trophic Fiber ajuda a regular o intestino de maneira gradativa e saudável. Sua fórmula nutricionalmente completa, sem glúten e sem lactose, contém fibras que auxiliam na recuperação de pacientes com transtornos gastrointestinais ou com nutrição enteral prolongada.', 'Baunilha', 'Dissolver em água filtrada e tratada (temperatura ambiente) até completa homogeneização.', 1, '2022-03-15 12:43:31'),
(232, 1, 'Trophic Infant - 400g', '/fotos_produtos/1650119744__download.png', '[\"Pediátrico\"]', 'Enteral', '[\"Aberto (Pó)\"]', '[\"Polimérico\",\"Sem Fibras\"]', NULL, '[\"Sem Sacarose\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', NULL, '[\"6\",\"7\",\"9\"]', '[\"Colher-medida\",\"Colher-medida\",\"Colher-medida\"]', '[\"43,8\",\"51,1\",\"65,7\"]', '[\"1,0\",\"1,2\",\"1,5\"]', '[\"170\",\"160\",\"150\"]', '[\"200\",\"200\",\"200\"]', 'Prodiet', '454', '57', '14', '18', '0', 'Crianças com risco nutricional ou desnutridas, hospitalizadas ou em cuidado domiciliar, que necessitam de nutrição enteral prolongada.', 'Trophic Infant é uma nutrição completa com tudo o que as crianças precisam para ficarem mais fortes e bem nutridas. Excelente mix de proteínas que ajudam no crescimento e desenvolvimento, podendo ser a única fonte de alimentação via sonda ou misturado a diversos preparos.  A versão em pó é versátil e permite diferentes diluições de 1,0 a 1,5 kcal/ ml.', 'Baunilha', 'Dissolver o produto à metade de água filtrada e tratada. Mexa com uma colher até completa homogeneização e complete com o volume de água restante.', 1, '2022-03-15 12:52:37');
