(234, 1, 'Diamax - 1L', '/fotos_produtos/1647377463__diamax-1l.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Sem Fibras\"]', '[\"1000\"]', '[\"Tetra Pak\"]', NULL, 'ml', NULL, NULL, NULL, '[\"1,0\"]', NULL, NULL, 'Prodiet', '100', '11', '4,3', '4,3', '1,5', 'Controle glicêmico e prevenção das complicações do diabetes.\r\n\r\n', 'Fórmula nutricionalmente completa, desenvolvida especialmente para o controle glicêmico em casos de diabetes. Com uma composição isenta de açúcares e reduzida em calorias e carboidratos, Diamax previne as complicações da doença, proporcionando bem-estar e melhor qualidade de vida.', 'Baunilha', 'Para usar é só agitar, abrir e consumir, simples assim.', 1, '2022-03-15 17:51:03'),
(235, 1, 'Diamax IG - 1L', '/fotos_produtos/1647377766__diamax-ig-1l.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Líquido / Creme\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', 'ml', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Prodiet', '100', '10', '4,4', '4,7', '1,5', 'Controle da glicemia para situações diversas. \r\n\r\n', 'Fórmula nutricionalmente completa, desenvolvida especialmente para o controle da glicemia. Com baixo índice glicêmico, isento de sacarose e 28 vitaminas e minerais, DiamaxIG é ideal para a praticidade do dia a dia.', 'Baunilha', 'Para usar é só agitar, abrir e consumir, simples assim.', 1, '2022-03-15 17:56:06'),
(236, 1, 'CarboCH - 400g', '/fotos_produtos/1647377913__carbo-ch-400g.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Prodiet', '', '', '', '', '', 'Necessidade elevada de calorias e abreviação de jejum pré operatório.\r\n\r\n', 'CarboCH é ideal para quem precisa de mais energia no dia a dia. Podendo ser utilizado como prática para abreviação do jejum pré operatório na ingestão de líquidos claros com carboidratos. Além de ser versátil, sem sabor e pode ser adicionado a preparações diversas doces ou salgadas.', 'Sem sabor', 'Dissolver em água filtrada e tratada (temperatura ambiente) até completa homogeneização. Pode ser acrescido em preparações variadas.', 1, '2022-03-15 17:58:33'),
(237, 1, 'Fortini Complete Chocolate - 400g', '/fotos_produtos/1658767516__fortini-complete-chocolate-400g-1632144959542.jpg.webp', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '420', '54', '14', '16', '6,1', 'Crianças com dificuldades alimentares, caracterizada por deficiência no consumo de qualidade, quantidade e/ou variedade de alimentos, que possam se beneficiar com uma complementação alimentar.            \r\n\r\n\r\nFaixa etária: 3-10 anos.', ' Fórmula pediátrica para nutrição enteral e oral em pó, nutricionalmente completa, normocalórica (1,0kcal/ml) com alto teor de vitaminas e minerais, fonte de fibras e sem adição de sacarose.       \r\n', 'Chocolate', '10 colheres medida (aproximadamente 45,6g) de pó+ 180mL de água\r\nVolume médio para 100% da IDR para vitaminas e minerais (mL):\r\n3 anos - 1200mL\r\n4 a 8 anos - 1400mL\r\n9 a 10 anos - 1600mL ', 1, '2022-03-23 12:25:40'),
(238, 1, 'Fortini Complete Vitamina de fruta - 400g', '/fotos_produtos/1649791762__fortini-complete-vitamina-de-frutas.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '435', '60', '13', '16', '4,2', 'Crianças com dificuldades alimentares, caracterizada por deficiência no consumo de qualidade, quantidade e/ou variedade de alimentos, que possam se beneficiar com uma complementação alimentar.            \r\n\r\n\r\nFaixa etária: 3-10 anos.', ' Fórmula pediátrica para nutrição enteral e oral em pó, nutricionalmente completa, normocalórica (1,0kcal/ml) com alto teor de vitaminas e minerais, fonte de fibras e sem adição de sacarose.       \r\n', 'Vitamina de fruta', '10 colheres medida (aproximadamente 45,6g) de pó+ 180mL de água\r\nVolume médio para 100% da IDR para vitaminas e minerais (mL):\r\n3 anos - 1200mL\r\n4 a 8 anos - 1400mL\r\n9 a 10 anos - 1600mL ', 1, '2022-03-23 12:26:02'),
(239, 1, 'Fortini Plus Sem sabor', '/fotos_produtos/1649791878__fortini-plus-sem-sabor.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Lactose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"7\"]', '[\"Colher-medida\"]', '[\"42,7\"]', '[\"1,5\"]', '[\"110\"]', '[\"140\"]', 'Danone', '492', '61', '11', '23', '0', 'Crianças em risco nutricional, desnutridas ou com desaceleração do crescimento; com doenças crônicas (ex. fibrose cística, cardiopatias, doença celíaca, câncer, etc). Faixa etária: 3-10 anos.', 'Fórmula pediátrica para nutrição enteral ou oral para crianças, em pó, nutricionalmente completa e rica em vitaminas e minerais. Permite preparo nas diluições 1,0kcal/ml; 1,25kcal/ml e 1,5kcal/ml.\r\n', 'Sem sabor', '140mL a 1,5kcal/mL - 7 colheres-medida (aproximadamente 42,7g) de pó + 100mL de água \r\n200mL a 1kcal/mL - 7 colheres-medida (aproximadamente 42,7g) de pó + 180mL de água', 1, '2022-03-23 12:26:37'),
(240, 1, 'Neoforte Morango EXCLUIR', '/fotos_produtos/1645399740__neoforte-morango.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Lactose\",\"Com Fibras\"]', '[\"400g\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"2,5\"]', '[\"Colher-medida\"]', '[\"21,3\"]', '[\"1,0\"]', '[\"80\"]', '[\"100\"]', 'Danone', '459', '51', '16', '21', '1,9', 'Para crianças com alergias alimentares (à proteína do leite de vaca, à soja, a hidrolisados e a múltiplas proteínas).', 'Alimento para Situações Metabólicas Especiais para Nutrição Enteral/ Oral, sabor artificial de baunilha formulado para portadores de alergia às proteínas do leite de vaca. Neoforte deve ser preparado imediatamente antes do consumo com água fria previamente fervida. Neoforte pode ser consumido junto com frutas ou hortaliças, conforme orientação de médico e/ou nutricionista.\r\n', 'Morango', '3 colheres-medida (24g) + 90mL de água = 110mL\r\n4 colheres-medida (32g) + 120mL de água = 150mL\r\n5 colheres-medida (40g) + 150mL de água = 190mL\r\n6 colheres-medida (48g) + 180mL de água = 230mL\r\n7 colheres-medida (56g) + 210mL de água = 270mL', 1, '2022-03-23 12:27:00'),
(241, 1, 'Nutrini Energy Multi Fiber 500mL', '/fotos_produtos/1649792261__nutrini-energy-multi-fiber-pack.png', '[\"Pediátrico\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, NULL, '[\"500\"]', '[\"Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Danone', '151', '19', '4,0', '6,7', '0,8', 'Pacientes em risco nutricional ou desnutridos, com necessidades calóricas aumentadas ou restrição de volume, associada à necessidade de regularização do trânsito intestinal. \r\n', 'Fórmula modificada para nutrição enteral, hipercalórica, normoproteica e enriquecida com fibras. Especialmente formulada para auxiliar pacientes em risco nutricional ou desnutridos com necessidades energéticas aumentadas e restrição de volume. Isenta de lactose, sacarose e glúten. Com a mistura de quatro proteínas de alto valor biológico e mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA). Enriquecido com mix de carotenóides e mix de fibras MF6. ', '', '', 1, '2022-03-23 12:27:39'),
(242, 1, 'Nutrini Multi Fiber 200mL', '/fotos_produtos/1656183005__nutrini-multi-fiber-200ml-danone-1.jpg', '[\"Pediátrico\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Com Fibras\"]', NULL, '[\"Sem Lactose\",\"Com Fibras\"]', '[\"200\"]', '[\"Garrafa Plástica\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '101', '13', '2,5', '4,4', '0,80', 'Para crianças com necessidade de nutrição enteral normocalórica, que se beneficiem do uso de fibras.', 'Fórmula pediátrica para nutrição enteral. Nutricionalmente completa, normocalórica e normoproteica, enriquecida com o exclusivo mix de carotenoides e com o exclusivo MF6, com 50% de fibras solúveis e 50% de fibras insolúveis. Baixa osmolaridade. Isento de lactose, sem adição de sacarose e não contém glúten.', '', '', 1, '2022-03-23 12:28:11'),
(243, 1, 'Nutri Renal D', '/fotos_produtos/1644455355__nutri-renal-d.png', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pak\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"2,0\"]', '[\"\"]', '[\"\"]', 'Danone', '200', '28', '7,5', '6,6', '0', 'Pacientes com insuficiência renal aguda ou crônica em tratamento dialítico, com restrição de eletrólitos e fluidos.', 'Fórmula modificada para nutrição enteral ou oral, formulado para pacientes com função renal comprometida em diálise. Hipercalórico (2,0kcal/ml), nutricionalmente completo, normoproteico e com perfil lipídico de acordo com ADA e AHA.\r\n', 'Baunilha', 'Manter a embalagem fechada à temperatura ambiente em local seco e fresco. Após aberta, conservar devidamente tampada e sob refrigeração por no máximo 24 horas. Nunca utilize produtos com data de validade vencida.', 1, '2022-03-23 12:28:44'),
