(281, 1, 'Nutren Senior Sopa Nutritiva frango e aveia', '/fotos_produtos/1658428903__aaa.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Lactose\",\"Com Fibras\"]', '[\"40\"]', '[\"Sachê\"]', '[\"\"]', 'gramas', '[\"1\"]', '[\"Unidade01\"]', '[\"40g\"]', '[\"0,54\"]', '[\"220\"]', '[\"250\"]', 'Nestlé', '337,5', '32,5', '40', '5,25', '19', 'Como parte de dieta ou para complementação da nutrição diária para auxiliar na manutenção das funções do tecido ósseo e do músculo-esquelético', 'Mistura para sopa nutritiva de feijão e carne, com 16 g de proteínas e 50% menos sódio*. Nutren® Senior Sopa possui uma combinação de proteína, cálcio, vitamina D e nutrientes\r\nessenciais para reforçar diariamente a vitalidade e força de adultos a partir de 50 anos. \r\n*Comparado à sopa de feijão Nestlé.', 'Feijão', 'Despeje o conteúdo do envelope (40 g*) em um recipiente.\r\nAdicione 220 mL de água fervente. Misture bem e aguarde\r\n2 minutos.\r\n*Quantidade suficiente para preparo de 250 mL.', 1, '2022-07-21 09:17:18'),
(282, 1, 'Diasip Pó baunilha 720g', '/fotos_produtos/1658429371__ddd.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\"]', '[\"720\"]', '[\"Lata\"]', '[\"19,3\"]', 'gramas', '[\"3\"]', '[\"Colher-medida\"]', '[\"58\"]', '[\"1,04\"]', '[\"150\"]', '[\"\"]', 'Danone', '365,5', '48,2', '20,6', '9,6', '12,7', 'Suplementar a alimentação de adultos > 19 anos. Devido à sua composição nutricional, pode ser indicado à pacientes com DM 1 e 2, diabetes gestacional, síndrome metabólica e intolerância à glicose.', 'Suplemento alimentar em pó para nutrição oral com densidade energética normal, fonte de proteínas e fibras. Com alto teor de vitaminas C, D, B12 e zinco.', 'Baunilha', 'Dissolver 58g (3 colheres-medida) do produto em 100mL de água potável, misture bem e complete com mais 50mL de água misturando até ficar homogêneo. Ou adicione 3 colheres-medida de produto em 150mL de água potável e misture em uma coqueteleira. Recomendação de consumo: 1 a 2 porções de 58g ao dia', 1, '2022-07-21 09:17:41'),
(283, 1, 'Fortini Complete Baunilha - 800g', '/fotos_produtos/1645191692__fortini-complete-baunilha.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"800\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '435', '60', '13', '16', '4,2', 'Crianças com dificuldades alimentares, caracterizada por deficiência no consumo de qualidade, quantidade e/ou variedade de alimentos, que possam se beneficiar com uma complementação alimentar.            \r\n\r\n\r\nFaixa etária: 3-10 anos.', ' Fórmula pediátrica para nutrição enteral e oral em pó, nutricionalmente completa, normocalórica (1,0kcal/ml) com alto teor de vitaminas e minerais, fonte de fibras e sem adição de sacarose.       \r\n', 'Baunilha', '10 colheres medida (aproximadamente 45,6g) de pó+ 180mL de água\r\nVolume médio para 100% da IDR para vitaminas e minerais (mL):\r\n3 anos - 1200mL\r\n4 a 8 anos - 1400mL\r\n9 a 10 anos - 1600mL ', 1, '2022-07-21 09:18:32'),
(284, 1, 'Fortini Complete Chocolate - 800g', '/fotos_produtos/1648237597__fortini-complete-chocolate.png', '[\"Pediátrico\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Com Fibras\"]', '[\"800\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,0\"]', '[\"\"]', '[\"\"]', 'Danone', '420', '54', '14', '16', '6,1', 'Crianças com dificuldades alimentares, caracterizada por deficiência no consumo de qualidade, quantidade e/ou variedade de alimentos, que possam se beneficiar com uma complementação alimentar.            \r\n\r\n\r\nFaixa etária: 3-10 anos.', ' Fórmula pediátrica para nutrição enteral e oral em pó, nutricionalmente completa, normocalórica (1,0kcal/ml) com alto teor de vitaminas e minerais, fonte de fibras e sem adição de sacarose.       \r\n', 'Chocolate', '10 colheres medida (aproximadamente 45,6g) de pó+ 180mL de água\r\nVolume médio para 100% da IDR para vitaminas e minerais (mL):\r\n3 anos - 1200mL\r\n4 a 8 anos - 1400mL\r\n9 a 10 anos - 1600mL ', 1, '2022-07-21 09:19:23'),
(285, 1, 'Nutren Protein Baunilha', '/fotos_produtos/1643815483__nutren-protein-baunilha.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"2\"]', '[\"Colher de sopa\"]', '[\"31,5\"]', '[\"0,59\"]', '[\"180\"]', '[\"200\"]', 'Nestlé', '374,6', '41,2', '44,4', '3,8', '0', 'Para jovens e adultos que querem mais foco e energia no dia a dia corrido', 'Suplemento alimentar em pó com Whey Protein, cafeína e 20 vitaminas e minerais. Sem adição de açúcares. Uma porção de 31,5 g preparada com 180 mL de leite, oferece 20 g de proteína.\r\n', 'Artificial de baunilha', 'Adicione 2 colheres de sopa cheias (31,5 g) a 180 mL de leite desnatado e misture bem até completa dissolução. \r\nConsumir uma porção ao dia.', 1, '2022-07-21 09:22:22'),
(286, 1, 'Nutren Protein Baunilha', '/fotos_produtos/1643815483__nutren-protein-baunilha.jpeg', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\",\"Sem Fibras\"]', '[\"400\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"2\"]', '[\"Colher de sopa\"]', '[\"31,5\"]', '[\"0,59\"]', '[\"180\"]', '[\"200\"]', 'Nestlé', '374,6', '41,2', '44,4', '3,8', '0', 'Para jovens e adultos que querem mais foco e energia no dia a dia corrido', 'Suplemento alimentar em pó com Whey Protein, cafeína e 20 vitaminas e minerais. Sem adição de açúcares. Uma porção de 31,5 g preparada com 180 mL de leite, oferece 20 g de proteína.\r\n', 'Artificial de baunilha', 'Adicione 2 colheres de sopa cheias (31,5 g) a 180 mL de leite desnatado e misture bem até completa dissolução. \r\nConsumir uma porção ao dia.', 1, '2022-07-21 09:22:23');
