(287, 1, 'Diasip pó chocolate 360g', '/fotos_produtos/1644763955__diasip-po-chocolate.png', '[\"Adulto\"]', 'Suplemento', NULL, NULL, '[\"Pó\"]', '[\"Sem Sacarose\"]', '[\"360\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"3\"]', '[\"Colher-medida\"]', '[\"58\"]', '[\"1,04\"]', '[\"150mL\"]', '[\"\"]', 'Danone', '365,5', '48,2', '20,6', '10', '12,7', 'Suplementar a alimentação de adultos > 19 anos. Devido à sua composição nutricional, pode ser indicado à pacientes com DM 1 e 2, diabetes gestacional, síndrome metabólica e intolerância à glicose.', 'Suplemento alimentar em pó para nutrição oral com densidade energética normal, fonte de proteínas e fibras. Com alto teor de vitaminas C, D, B12 e zinco.', 'Chocolate', 'Dissolver 58g (3 colheres-medida) do produto em 100mL de água potável, misture bem e complete com mais 50mL de água misturando até ficar homogêneo. Ou adicione 3 colheres-medida de produto em 150mL de água potável e misture em uma coqueteleira. Recomendação de consumo: 1 a 2 porções de 58g ao dia', 1, '2022-07-21 19:41:28'),
(288, 1, 'Thicken Up Clear Lata', '/fotos_produtos/1658779764__thickenup.png', '[\"Adulto\"]', 'Módulo', NULL, NULL, NULL, NULL, '[\"125\"]', '[\"Lata\"]', '[\"\"]', 'gramas', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', 'Nestlé', '', '', '', '', '', 'Para pacientes disfágicos', 'Espessante e gelificante para alimentos que modifica\r\ninstantaneamente a textura e a consistência dos alimentos quentes ou frios, sem alterar cor, sabor e cheiro dos alimentos.', 'Sem sabor', 'Em um recipiente vazio, coloque a quantidade indicada\r\nna tabela de dosagem para obter textura de néctar, mel ou pudim. Acrescente o alimento quente ou frio e mexa vigorosamente.\r\nAlimento: 100 mL de água, sopas e preparações culinárias\r\nNéctar: 1 colher-medida ou 1 sachê\r\nMel: 2 colheres-medida ou 2 sachês\r\nPudim: 3 colheres-medida ou 3 sachês', 1, '2022-07-21 19:41:48'),
(290, 1, 'Nutrison Energy - Pack 1000ml', '/fotos_produtos/1659050306__nutrison-energy-pack-jp.jpg', '[\"Adulto\"]', 'Enteral', '[\"Fechado\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Danone', '150', '18', '6,0', '5,8', '0', 'Pacientes em risco nutricional ou desnutridos. Pacientes com necessidades nutricionais aumentadas ou restrição de volume. ', 'Fórmula modificada para nutrição enteral, com alta densidade energética e normoprotica. Especialmente formulada para atender à demanda de pacientes em risco nutricional ou desnutridos, como também de pacientes com necessidades nutricionais aumentadas ou restrição de volume. Isenta de sacarose, lactose, glúten e fibras. Contém a mistura de quatro proteínas de alto valor biológico, mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA) e baixo teor de gordura saturada. Enriquecido com mix de carotenoides (alfa, beta e gama caroteno, licopeno, luteína e zeaxantina).', '', '', 1, '2022-07-26 14:15:42'),
(291, 1, 'Nutrison Energy - Tetra Pack 1000ml', '/fotos_produtos/1658773019__7891025699996-1.jpg', '[\"Adulto\"]', 'Enteral', '[\"Aberto (Líquido)\"]', '[\"Sem Lactose\",\"Sem Sacarose\",\"Polimérico\",\"Sem Fibras\"]', NULL, NULL, '[\"1000\"]', '[\"Tetra Pack\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"1,5\"]', '[\"\"]', '[\"\"]', 'Danone', '150', '18', '6,0', '5,8', '0', 'Pacientes em risco nutricional ou desnutridos. Pacientes com necessidades nutricionais aumentadas ou restrição de volume. ', 'Fórmula modificada para nutrição enteral, com alta densidade energética e normoprotica. Especialmente formulada para atender à demanda de pacientes em risco nutricional ou desnutridos, como também de pacientes com necessidades nutricionais aumentadas ou restrição de volume. Isenta de sacarose, lactose, glúten e fibras. Contém a mistura de quatro proteínas de alto valor biológico, mistura de lipídios, fornecendo os ácidos graxos w3 (DHA e EPA) e baixo teor de gordura saturada. Enriquecido com mix de carotenoides (alfa, beta e gama caroteno, licopeno, luteína e zeaxantina).', '', '', 1, '2022-07-26 14:18:46');
