(415, 31, 19, NULL, 'DIAGNÓSTICO CLÍNICO\r\n- Pneumonia aspirativa\r\nHISTÓRIA DA DOENÇA ATUAL E ANAMNESE NUTRICIONAL\r\nComorbidades: \r\n- Paralisia cerebral (secundária à má formação - erro de migração neural)\r\n- Pneumonias de repetição;\r\n- Diarreia crônica por disbiose;\r\n- Tratou clostridium recente em dez/22\r\nAlergias e/ou intolerâncias alimentares: nega\r\nApetite: preservado, dieta via GTT\r\nPerda ponderal não intencional recente: 28,5 % no último ano, em recuperação\r\nEliminações fisiológicas: Evacuações e diurese presentes e sem alterações, apresentou evacuações pastosas nos últimos dias, com melhora após tiorfan e probiótico.\r\nSintomas Gastrointestinais: sem alterações\r\nReconciliação de Terapia Nutricional: Estava em uso de dieta enteral via GTT no domicílio, no volume de 1333ml fracionada a cada 2 horas diárias, totalizando 2mil kcal/dia. \r\nFoi avaliado segundo critérios da NRS 2002, sendo detectado risco nutricional (perda ponderal + gravidade da doença).\r\nNa última semana no dia 03/01 paciente com dieta enteral em curso sem queixas, sendo evoluído aporte para a meta que o paciente ja recebia em casa e também módulo de fibras. Em 04/01 em meta nutricional  função intestinal com evacuação 2x pastosa. Em 05/01 em meta, com evacuações 3x líquida e 2x pastosa, ja em uso de medicações constipantes. Em 06/01 apresentou vômito 1x, mas foi mantido aporte nutricional. Do dia 07/01 ao dia 08/01 paciente em meta nutricional, mantida condutas. Em 10/01 paciente com dieta enteral em curso com boa tolerância e função intestinal presente 1x pastosa. Em 12/01 com relato de êmese no dia anterior, sem prejuizo a dieta. Em 13/01 ajustado vazão da água. Em 14/01 reduzido aporte hídrico devido balanço bastante positivo. Em 18/01 paciente com boa tolerância a dieta enteral, mas estava em dieta zero no momento da visita para realizar exame. Em 19/01 EDA sem intercorrências. Em 22/01 paciente com boa tolerância a dieta durante a semana, porém apresentou elevação da PCR sendo realizado tomografia, mas mantida conduta da nutrição. Do dia 24/01 ao dia 26/01 paciente com boa tolerância a dieta, em meta nutricional e funcionamento intestinal presente. Em 27/01 apenas foi ajustada a vazão da dieta para melhor administração pela enfermagem. Em 31/01 paciente apresentando muitas evacuações, causando lesão na região perianal, sendo então otimizado as medidas constipantes e mantido suporte nutricional pleno. Em 02/02 com melhora no número de evacuações. Em 03/02 paciente bastante agitado, retornou a apresentar evacuações volumosas. Em 04/02 com melhora da agitação e as evacuações, mantido aporte nutricional pleno. Do dia 06/02 ao dia 10/02 paciente com boa tolerância a dieta enteral, em meta nutricional. Em 11/02 paciente com diurese reduzida e concetrada, então foi aumentado aporte hídrico para 1500ml. Do dia 14/02 ao dia 16/02 paciente com dieta eteral em meta nutricional com boa tolerãncia. Em 17/02 paciente apresentou 6 evacuações líquidas, mas foi mantida conduta nutricional e discutido com equipe médica medidas constipantes. Do dia 20/02 ao dia 26/02 paciente com dieta enteral em curso com boa tolerância em meta nutricional, apenas oscilando com evacuações mais volumosas em alguns dias. \r\nHoje paciente em leito, consciente, com dieta enteral com boa tolerância. Segue em acompanhamento pela EMTN com previsão de alta com Home Care.\r\n', NULL, '2023-03-23', 'Altura referida', '1,60', '[\"Peso aferido\"]', '[\"49,6\"]', '[\"19.37\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1679586409122\":\"Circunfer\\u00eancia da panturrilha\"}', '[\"25,5\",\"27,5\"]', '{\"0\":\"Direito\",\"1679586409122\":\"Direito\"}', '[\"\"]', '[\"\"]', NULL, '', '', 'Desnutrição Não Grave Associada à Doença Crônica', 'Com Risco Nutricional', 'Paciente Corado, Hidratado, Anictérico, Acianótico, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Panturrilha, leve em Quadríceps;.Depleção de tecido adiposo visualizada: leve em Coxa interna. Abdome flácido, plano, normotimpânico, indolor. Edema MMSS ausente. Edema MMII ausente. Capacidade funcional reduzida.', 'DATA 02/01/2023: Crea 0,80 / K 5,5 / Na 134 / Ureia 40\r\nDATA 26/02/2023, PCR  5.32, HB  8.60, LEUCÓCITOS  10300.000, LINFÓCITOS  2266.000, UR  24.00, CR  0.40, NA  136, K  3.4, P  3.0, MG  1.6, LACT  2.00, \r\n', 'Peso aferido', '49,6', '1488 (30 kcal/kg)', '#formula_bolso', '30', '', '', '', '', 'Peso aferido', '49,6', '74.4 (1.5 g/kg)', '1.5', 'Peso aferido', '49,6', '1488 (30 ml/kg)', '30', 'Adulto', 'Enteral', 'Prescrição Automática', 'GTT', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 1, NULL, '[\"\"]', '[\"Cont\\u00ednua\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '10:00', '16:00', '5', '02:00', '{\"01\":\"08:00\",\"02\":\"11:00\",\"03\":\"14:00\",\"04\":\"17:00\",\"05\":\"20:00\"}', '5', '100', '{\"01\":\"10:00\",\"02\":\"13:00\",\"03\":\"16:00\",\"04\":\"19:00\",\"05\":\"20:00\"}', '', '500', NULL, '1786 (-10%),2182 (10%)', '59 (-20%),89 (20%)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2023-03-23 12:46:07'),
