(417, 32, 1, NULL, 'DIAGNÓSTICO CLÍNICO\r\n- Rebaixamento do nível de consciência, febre e tosse  Sepse de foco pulmonar por pneumonia\r\nHISTÓRIA DA DOENÇA ATUAL E ANAMNESE NUTRICIONAL\r\nComorbidades: \r\n- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio  (normocalórico/normoproteico 1,2 kcal + 800ml/ dia + água 1000 ml) \r\n\r\nFoi avaliada na admissão segundo critérios da NRS 2002, sendo detectado risco nutricional (gravidade da doença + idade). \r\nIniciou dieta enteral em baixo volume tolerando bem, sem intercorrência, sendo progredida para meta nutricional com boa tolerância e eliminações fisiológicas sem alterações em relação ao padrão usual.\r\n', 'df', '2023-03-23', 'Altura referida', '1,78', '{\"0\":\"Peso usual\",\"1679593498272\":\"Peso aferido\"}', '[\"80\",\"83\"]', '[\"25.24\",\"26.19\"]', '[\"\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', NULL, '', 'Não Realizado.', 'Desnutrição Não Grave Relacionado à Doença Crônica Agudizada', 'Risco Nutricional', 'Paciente Corada, Hidratada, Anictérica, Acianótica, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Bíceps, moderada em Deltoide, moderada em Panturrilha, moderada em Quadríceps; Depleção de tecido adiposo não visualizada. Abdome flácido, globoso, indolor. Edema MMSS ausente. Edema em MMII 2+/4+. Capacidade funcional restrita ao leito.', 'DATA 05/03/2023: HB 10/03/ HT 32,2 / Leuco 14930,0 /  Linf 448/ PCR 10,37 / 47,0 / Cr 0,91 / Na 142 / K 2,7 / Ca 1,09 / Lac 3