(422, 34, 22, NULL, '- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio (normocalórico/normoproteico 1,2 kcal + água 1000 ml) \r\n\r\nFoi avaliada na admissão segundo critérios da NRS 2002, sendo detectado risco nutricional (gravidade da doença + idade). \r\nIniciou dieta enteral em baixo volume tolerando bem, sem intercorrência, sendo progredida para meta nutricional com boa tolerância e eliminações fisiológicas sem alterações em relação ao padrão usual.\r\nTerá cuidadora em tempo integral e acesso à bomba de infusão contínua, podendo fazer uso de dieta enteral em sistema fechado (correndo em 12h diurnas com início às 08:00h e término às 20:00h) ou sistema aberto fracionada em 6x/dia com tempo de infusão de 2h por horário. Água livre: 4 horários de 250 ml.\r\n', NULL, '2023-03-25', 'Altura referida', '1,78', '[\"Peso aferido\"]', '[\"83\"]', '[\"26.19\"]', '[\"\"]', '[\"34\"]', '[\"Direito\"]', '[\"Dobra tricipital\"]', '[\"12\"]', '[\"Esquerdo\"]', '', 'DATA 05/03/2023: HB 10/03/ HT 32,2 / Leuco 14930,0 /  Linf 448/ PCR 10,37 / 47,0 / Cr 0,91 / Na 142 / K 2,7 / Ca 1,09 / Lac 3,2 \r\nDATA 16/03/2023, PCR  43.31, HB  10.70, LEUCÓCITOS  14720.000, LINFÓCITOS  1914.000, UR  106.00, CR  1.33, NA  136, K  4.9, P  2.0, MG  1.7\r\n', 'Desnutricao nao grave relacionada a doenca cronica', 'risco nutricional', 'Paciente Corada, Hidratada, Anictérica, Acianótica, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Bíceps, moderada em D