(424, 36, 24, '8ea5pi', 'Paciente Laura Eduardo Santana, foi admitida em unidade de terapia intensiva devido a Rebaixamento do nível de consciência, febre e tosse, acompanhada da Mãe Antoninha Lira Santo. \r\nAcompanhante relata que a paciente possui como história patológica pregressa: HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição. Durante a internação foi diagnosticada com sepse de foo pulmonar por pneumonia. \r\n\r\nFoi avaliada na admissão segundo critérios da NRS 2002, sendo detectado risco nutricional (gravidade da doença + idade). \r\n\r\nIniciou dieta enteral em baixo volume tolerando bem, sem intercorrência, sendo progredida para meta nutricional com boa tolerância e eliminações fisiológicas sem alterações em relação ao padrão usual.\r\n\r\nTerá cuidadora em tempo integral e acesso à bomba de infusão contínua, podendo fazer uso de dieta enteral em sistema fechado (correndo em 12h diurnas com início às 08:00h e término às 20:00h) ou sistema aberto fracionada em 6x/dia com tempo de infusão de 2h por horário. Água livre: 4 horários de 250 ml.\r\n', 'df', '2023-03-05', 'Altura referida', '1,78', '[\"Peso ajustado\"]', '[\"83,0\"]', '[\"26.19\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1679752648747\":\"Circunfer\\u00eancia da panturrilha\",\"1679752687024\":\"\"}', '[\"34,0\",\"35,0\",\"\"]', '{\"0\":\"Direito\",\"1679752648747\":\"Esquerdo\"}', '[\"Dobra tricipital\"]', '[\"12,0\"]', '[\"Esquerdo\"]', '( x ) Risco nutricional ou Desnutrição;\r\n( x ) Paciente inconsciente ou com queda do nível de consciência;\r\n', 'RESULTADO DINAMOMETRIA (18/02/2023): 8 (  ) Direita ( x) Esquerda\r\nRESULTADO DINAMOMETRIA (23/03/2023): 11 (  ) Direita ( x) Esquerda\r\n', 'Desnutrição Não grave relacionada à doença crônica', 'Paciente em risco nutricional, NRS >3. ', 'Paciente Corada, Hidratada, Anictérica, Acianótica, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Bíceps, moderada em Deltoide, moderada em Panturrilha, moderada em Quadríceps; Depleção de tecido adiposo não visualizada. Abdome flácido, globoso, indolor. Edema MMSS ausente. Edema em MMII 2+/4+. Capacidade funcional restrita ao leito.', 'DATA 05/03/2023: HB 10/03/ HT 32,2 / Leuco 14930,0 /  Linf 448/ PCR 10,37 / 47,0 / Cr 0,91 / Na 142 / K 2,7 / Ca 1,09 / Lac 3,2 \r\nDATA 16/03/2023, PCR  43.31, HB  10.70, LEUCÓCITOS  14720.000, LINFÓCITOS  1914.000, UR  106.00, CR  1.33, NA  136, K  4.9, P  2.0, MG  1.7\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Adulto', 'Enteral', 'Prescrição Automática', 'GTT', 1, NULL, NULL, NULL, NULL, NULL, 1, NULL, 1, NULL, NULL, NULL, 1, NULL, '[\"\"]', '[\"Cont\\u00ednua\"]', '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', NULL, '[\"\"]', '[\"\"]', '[\"\"]', '[\"\"]', '15:00', '22:00', '', '', NULL, '6', '346', '{\"01\":\"06:00\",\"02\":\"09:00\",\"03\":\"12:00\",\"04\":\"15:00\",\"05\":\"18:00\",\"06\":\"21:00\"}', '', '2076', NULL, '1868 (-10%),2283 (10%)', '66 (-20%),100 (20%)', 'NECESSIDADES NUTRICIONAIS:\r\nCalorias: 2075 kcal/dia (25 kcal/kg Peso Seco/dia)\r\nProteína: 83 g/dia (1,0g/kg Peso Seco/dia)\r\nÁgua: 2075 ml/dia (25 ml/kg Peso Seco/dia)\r\n\r\nCONDUTA NUTRICIONAL\r\nMantenho TNE via GTT em meta;\r\nEntrego relatório de alta hospitalar.\r\n\r\n', NULL, NULL, NULL, 1, 1, 1, 1, 1, 1, 1, 1, NULL, NULL, 1, '2023-03-25 11:01:40'),
(425, 37, 23, 'wt3q72', 'DIAGNÓSTICO CLÍNICO\r\n- Rebaixamento do nível de consciência, febre e tosse  Sepse de foco pulmonar por pneumonia\r\n\r\nComorbidades: \r\n- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio (normocalórico/normoproteico 1,2 kcal + água 1000 ml) \r\n\r\nFoi avaliada na admissão segundo critérios da NRS 2002, sendo detectado risco nutricional (gravidade da doença + idade). \r\nIniciou dieta enteral em baixo volume tolerando bem, sem intercorrência, sendo progredida para meta nutricional com boa tolerância e eliminações fisiológicas sem alterações em relação ao padrão usual.\r\nTerá cuidadora em tempo integral e acesso à bomba de infusão contínua, podendo fazer uso de dieta enteral em sistema fechado (correndo em 12h diurnas com início às 08:00h e término às 20:00h) ou sistema aberto fracionada em 6x/dia com tempo de infusão de 2h por horário. Água livre: 4 horários de 250 ml.\r\n', 'df', '2023-03-25', 'Altura referida', '1,78', '[\"Peso referido\"]', '[\"83\"]', '[\"26.19\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1679752966394\":\"Circunfer\\u00eancia da panturrilha\"}', '[\"34\",\"35\"]', '{\"0\":\"Direito\",\"1679752966394\":\"Esquerdo\"}', '[\"Dobra tricipital\"]', '[\"12\"]', '[\"Esquerdo\"]', '', '', 'Desnutrição Não grave relacionada à doença crônica', 'Com risco nutricional', 'Paciente Corada, Hidratada, Anictérica, Acianótica, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Bíc