(430, 42, 24, 'elr5ns', 'Paciente Lucas Gabirl Nascimento Silva buscou atendimento hospitalar, acompanhado dos pais, devido à queixa de tosses intensas, sendo diagnosticado com pneumonia aspirativa. \r\n\r\nPaciente possui como comorbidades:\r\n- Paralisia cerebral (secundária à má formação - erro de migração neural)\r\n- Pneumonias de repetição;\r\n- Diarreia crônica por disbiose;\r\n- Tratou clostridium recente em dez/22\r\n\r\nAlergias e/ou intolerâncias alimentares: nega\r\nApetite: preservado, dieta via GTT\r\nPerda ponderal não intencional recente: 28,5 % no último ano, em recuperação\r\nEliminações fisiológicas: Evacuações e diurese presentes e sem alterações, apresentou evacuações pastosas nos últimos dias, com melhora após tiorfan e probiótico.\r\nSintomas Gastrointestinais: sem alterações\r\nReconciliação de Terapia Nutricional: Estava em uso de dieta enteral via GTT no domicílio, fracionada em 4 vezes ao dia.', 'df', '2023-03-25', 'Altura referida', '1,60', '[\"Peso aferido\"]', '[\"49,6\"]', '[\"19.37\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1679755400534\":\"Circunfer\\u00eancia da panturrilha\"}', '[\"23,0\",\"27,0\"]', '{\"0\":\"Esquerdo\",\"1679755400534\":\"Esquerdo\"}', '[\"\"]', '[\"\"]', NULL, '', '', 'Desnutrição Não Grave relacionada à doença crônica', 'Paciente em risco nutricional, NRS >3.', 'Paciente Corado, Hidratado, Anictérico, Acianótico, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Panturrilha, leve em Quadríceps; Depleção de tecido adiposo visualizada: leve em Coxa interna. Abdome flácido, plano, normotimpânico, indolor. Edema MMSS ausente. Edema MMII ausente. Capacidade funcional reduzida.', 'DATA 02/01/2023: Crea 0,80 / K 5,5 / Na 134 / Urea 40\r\nDATA 23/03/2023, PCR  5.32, HB  8.60, LEUCÓCITOS  10300.000, LINFÓCITOS  2266.000, UR  24.00, CR  0.40, NA  136, K  3.4, P  3.0, MG  1.6, LACT  2.00\r\n', 'Peso aferido', '49,6', '1984 (40 kcal/kg)', '#formula_bolso', '40', '', '',