(434, 46, 26, NULL, 'Comorbidades: \r\n- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio (normocalórico/normoproteico 1,2 kcal + água 1000 ml) \r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2023-03-25 11:44:48'),
(435, 47, 26, 've0str', 'Comorbidades: \r\n- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio (normocalórico/normoproteico 1,2 kcal + água 1000 ml) \r\n\r\n\r\n', '', '2023-03-25', 'Altura referida', '1,60', '[\"Peso aferido\"]', '[\"47,9\"]', '[\"18.71\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1679753778930\":\"Circunfer\\u00eancia da panturrilha\"}', '[\"25,5\",\"27,5\"]', '{\"0\":\"Direito\",\"1679753778930\":\"Direito\"}', '[\"\"]', '[\"\"]', '[\"Esquerdo\"]', 'Durante internação paciente fez uso de dieta enteral em meta nutricional, com boa tolerância, sem ocorrência de vômitos ou distensão abdominal.\r\nApresentando função intestinal com evacuação de 1 a 2x pastosa diariamente, porém alternando com períodos de constipação com necessidade de dieta enteral com fibras e sem sacarose para garantir o funcionamento intestinal adequado.\r\nNão terá disponibilidade de bomba para infusão contínua de dieta em domicílio.\r\nSegue em acompanhamento pela EMTN com previsão de alta com Home Care hoje 25/03.\r\n', '', 'Desnutrição Não Grave relacionada à doença crônica', 'Foi avaliado segundo critérios da NRS 2002, sendo detectado risco nutricional (perda ponderal + gravidade da doença).', 'Paciente Corado, Hidratado, Anictérico, Acianótico, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Panturrilha, leve em Quadríceps; Depleção de tecido adiposo visualizada: leve em Coxa interna. Abdome flácido, plano, normotimpânico