(468, 57, 1, NULL, 'DIAGNÓSTICO CLÍNICO\r\n- Rebaixamento do nível de consciência, febre e tosse  Sepse de foco pulmonar por pneumonia. \r\n\r\nHISTÓRIA DA DOENÇA ATUAL E ANAMNESE NUTRICIONAL\r\nComorbidades: \r\n- HAS, DRC não dialítica (nefroesclerose arteriolar hipertensiva), Hipotireoidismo, Síndrome demencial, DLP, ITU/Pneumonia de repetição\r\nAlergias e/ou intolerâncias alimentares: não relatado\r\nPerda ponderal não intencional recente: nega, relataram que houve ganho de peso recente.\r\nEliminações fisiológicas: evacuações com muvinlax e diurese presentes e sem alterações.\r\nSintomas Gastrointestinais: Nega náuseas, vômitos, distensão abdominal ou outros sintomas gastrointestinais.\r\nReconciliação de Terapia Nutricional: Estava em uso de TNE em domicílio (normocalórico/normoproteico 1,2 kcal + água 1000 ml) \r\n', 'df', '2023-06-03', 'Altura referida', '1,78', '[\"Peso seco\"]', '[\"83\"]', '[\"26.19\"]', '{\"0\":\"Circunfer\\u00eancia do bra\\u00e7o\",\"1685803424934\":\"Circunfer\\u00eancia da panturrilha\"}', '[\"34\",\"35\"]', '{\"0\":\"Direito\",\"1685803424934\":\"Esquerdo\"}', '[\"Dobra tricipital\"]', '[\"12\"]', '[\"Esquerdo\"]', '', '', 'Desnutrição Não grave relacionada à doença crônica (AND-ASPEN, 2012)\r\n', 'Foi avaliada na admissão segundo critérios da NRS 2002, sendo detectado risco nutricional (gravidade da doença + idade). ', 'Paciente Corada, Hidratada, Anictérica, Acianótica, com perfusão tecidual periférica Adequada. Depleção de massa muscular visualizada: leve em Bíceps, moderada em Deltoide, moderada em Panturrilha, moderada em Quadríceps; Depleção de tecido adiposo não visualizada. Abdome flácido, globoso, indolor. Edema MMSS ausente. Edema em MMII 2+/4+. Capacidade funcional restrita ao leito.', 'DATA 05/03/2023: HB 10/03/ HT 32,2 / Leuco 14930,0 /  Linf 448/ PCR 10,37 / 47,0 / Cr 0,91 / Na 142 / K 2,7 / Ca 1,09 / Lac 3,2 \r\nDATA 16/03/2023, PCR  43.31, HB  10.70, LEUCÓCITOS  14720.000, LINFÓCITOS  1914.000, UR  106.00, CR  1.33